    t[364] = "When a new service tunnel is created, or a service is run for the first time (e.g. the default jetty webserver, plugins), a private encryption key is created which essentially controls the ownership of address. This is usually named <code>&hellip;privKey.dat</code>, or <code>eepPriv.dat</code>, though it's a good idea to change the name to indicate the service it belongs to and then respecify it in the Tunnel Manager server settings. This .dat file should be backed up safely; lose it and you will lose ownership and control of your hostname!";
    t[365] = "Kdy\u017e je vytvo\u0159en nov\u00fd servisn\u00ed tunel nebo je servis spu\u0161t\u011bn poprv\u00e9 (nap\u0159. v\u00fdchoz\u00ed webov\u00fd server jetty, pluginy), vytvo\u0159\u00ed se Soukrom\u00fd \u0161ifrovac\u00ed kl\u00ed\u010d, kter\u00fd imanentn\u011b ovl\u00e1d\u00e1 vlastnictv\u00ed adresy. Obvykle se naz\u00fdv\u00e1 <code>&hellip;privKey.dat</code> nebo <code>eepPriv.dat</code>, ale je dobr\u00fd n\u00e1pad zm\u011bnit n\u00e1zev tak, aby nazna\u010doval slu\u017ebu, kter\u00e9 pat\u0159\u00ed, a pot\u00e9 jej zadat znovu v nastaven\u00ed serveru Tunelov\u00e9ho spr\u00e1vce. Tento .dat soubor by m\u011bl b\u00fdt bezpe\u010dn\u011b z\u00e1lohov\u00e1n; ztrat\u00edte ho a ztrat\u00edte vlastnictv\u00ed a kontrolu nad va\u0161\u00edm hostitelsk\u00fdm jm\u00e9nem!";
    t[368] = "This setting allows configuration of the maximum number of files per torrent I2PSnark will permit, when downloading or creating a torrent. Note that substantially increasing this value from the default of 2000 files may require additional configuration on the host system to increase the maximum number of open files the operating system will permit (e.g. <code>ulimit -n</code> on Linux). To change, add to I2PSnark's configuration file <code>i2psnark.config</code>. [Restart of I2PSnark or router required]";
    t[369] = "Toto nastaven\u00ed umo\u017e\u0148uje konfiguraci maxim\u00e1ln\u00edho po\u010dtu soubor\u016f na torrent, kter\u00fd I2PSnark povol\u00ed p\u0159i stahov\u00e1n\u00ed nebo vytv\u00e1\u0159en\u00ed torrentu. Je t\u0159eba poznamenat, \u017ee v\u00fdrazn\u00e9 zv\u00fd\u0161en\u00ed t\u00e9to hodnoty z v\u00fdchoz\u00ed hodnoty 2000 soubor\u016f m\u016f\u017ee vy\u017eadovat dal\u0161\u00ed konfiguraci v hostitelsk\u00e9m syst\u00e9mu, aby bylo mo\u017en\u00e9 zv\u00fd\u0161it maxim\u00e1ln\u00ed po\u010det otev\u0159en\u00fdch soubor\u016f, kter\u00fd povoluje opera\u010dn\u00ed syst\u00e9m (nap\u0159. <code>ulimit -n</code> na Linuxu). Abyste jej zm\u011bnili, p\u0159idejte do konfigura\u010dn\u00edho souboru I2PSnarku <code>i2psnark.config</code>. [Je nutn\u00e9 restartovat I2PSnark nebo router]";
