    t[549] = "Op\u011btovn\u00e9 sezen\u00ed ze souboru";
    t[554] = "Choose a name for your website (<i>hostname</i>.i2p), using lower-case. To verify that the hostname is available, check <a href=http://notbob.i2p/ target=_blank>notbob.i2p</a> or <a href=http://reg.i2p target=_blank>reg.i2p</a> before you decide. Enter the new name for your website on the <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a> where it says <i>Website name</i>, replacing the default <i>mysite.i2p</i> placeholder. If you want your website to be available when I2P starts, enable <i>Auto Start</i> and then click <i>Save</i>.";
    t[555] = "Vyberte n\u00e1zev pro va\u0161e webov\u00e9 str\u00e1nky (<i>hostname</i>.i2p) pou\u017eit\u00edm mal\u00fdch p\u00edsmen. Pro ov\u011b\u0159en\u00ed dostupnosti hostname zkontrolujte <a href=http://notbob.i2p/ target=_blank>notbob.i2p</a> nebo <a href=http://reg.i2p target=_blank>reg.i2p</a> p\u0159ed rozhodnut\u00edm. Na str\u00e1nce <a href='/i2ptunnel/edit?tunnel=3'>Konfigurace Spr\u00e1vce Tunel\u016f</a> zm\u011b\u0148te v\u00fdchoz\u00ed z\u00e1stupn\u00fd n\u00e1zev <i>mysite.i2p</i> na nov\u00fd n\u00e1zev webov\u00e9 str\u00e1nky. Pokud chcete, aby va\u0161e webov\u00e9 str\u00e1nky byly dostupn\u00e9 p\u0159i startu I2P, povolte <i>Automatick\u00fd start</i> a klikn\u011bte na <i>Ulo\u017eit</i>.";
