    t[616] = "Bonuses may be positive or negative, and affect the peer's inclusion in Fast and High Capacity tiers. Fast peers are used for client tunnels, and High Capacity peers are used for some exploratory tunnels.";
    t[617] = "Bonusy mohou b\u00fdt kladn\u00e9 nebo z\u00e1porn\u00e9 a ovliv\u0148uj\u00ed za\u0159azen\u00ed partnera do \u00farovn\u00ed Rychl\u00fd a Vysokokapacitn\u00ed. Pro klientsk\u00e9 tunely se pou\u017e\u00edvaj\u00ed rychl\u00e9 partnery a pro n\u011bkter\u00e9 pr\u016fzkumn\u00e9 tunely se pou\u017e\u00edvaj\u00ed vysokokapacitn\u00ed partnery.";
    t[618] = "Yes";
    t[619] = "Ano";
    t[620] = "While I2P will work fine in this configuration, if you really have over 128KBps of bandwidth to share, it will be much more helpful to the network if you open your firewall.";
    t[621] = "I2P bude v t\u00e9to konfiguraci fungovat dob\u0159e, ale pokud skute\u010dn\u011b m\u00e1te k sd\u00edlen\u00ed v\u00edce ne\u017e 128 KB/s \u0161\u00ed\u0159ky p\u00e1sma, bude pro s\u00ed\u0165 mnohem u\u017eite\u010dn\u011bj\u0161\u00ed, kdy\u017e otev\u0159ete svou firewall.";
    t[622] = "A command-line application supplied with I2P that is used to request URL resources, similar to <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> or <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget is also used internally by the router, for example to reseed from remote hosts. By default, eepget uses the HTTP proxy on <code>127.0.0.1:4444</code>.";
    t[623] = "P\u0159\u00edkazov\u00fd \u0159\u00e1dek dod\u00e1van\u00fd s I2P, kter\u00fd se pou\u017e\u00edv\u00e1 k po\u017eadov\u00e1n\u00ed URL zdroj\u016f, podobn\u00fd <a href=https://www.gnu.org/software/wget/ class='sitelink external' target=_blank rel=noreferrer>wget</a> nebo <a href=https://curl.haxx.se/ class='sitelink external' target=_blank rel=noreferrer>curl</a>. Eepget se pou\u017e\u00edv\u00e1 tak\u00e9 intern\u011b sm\u011brova\u010dem, nap\u0159\u00edklad pro res\u00eddenci z vzd\u00e1len\u00fdch hostitel\u016f. Eepget ve v\u00fdchoz\u00edm nastaven\u00ed pou\u017e\u00edv\u00e1 HTTP proxy na <code>127.0.0.1:4444</code>.";
