    t[722] = "Javadocs";
    t[723] = "Javadocs";
    t[724] = "An eepsite is a website that is hosted anonymously on the I2P network - you can access it by configuring your web browser to use I2P's HTTP proxy (see above) and browsing to the <code>.i2p</code> suffixed website (e.g. <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Also ensure your browser is configured to resolve DNS remotely when using the proxy to avoid DNS leaks.";
    t[725] = "Eepsite je webov\u00e1 str\u00e1nka, kter\u00e1 je hostov\u00e1na anonymn\u011b na s\u00edti I2P - m\u016f\u017eete se k n\u00ed dostat nakonfigurov\u00e1n\u00edm webov\u00e9ho prohl\u00ed\u017ee\u010de tak, aby pou\u017e\u00edval I2P HTTP proxy (viz v\u00fd\u0161e) a proch\u00e1zen\u00edm na webov\u00e9 str\u00e1nky se sufixem <code>.i2p</code> (nap\u0159\u00edklad <a href=http://i2p-projekt.i2p/ target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p</a>). Tak\u00e9 se ujist\u011bte, \u017ee v\u00e1\u0161 prohl\u00ed\u017ee\u010d je nastaven pro vzd\u00e1len\u00e9 DNS p\u0159i pou\u017eit\u00ed proxy, abyste se vyhnuli \u00faniku DNS.";
