    t[836] = "The first number is the number of peers your router has sent or received a message from in the last few minutes. This may range from 8-10 to several hundred, depending on your total bandwidth, shared bandwidth, and locally-generated traffic. The second number is the number of peers seen in the last hour or so. Do not be concerned if these numbers vary widely. <a href='/configstats#router.activePeers'>[Enable graphing]</a>.";
    t[837] = "Prvn\u00ed \u010d\u00edslo je po\u010det jin\u00fdch uzl\u016f, od kter\u00fdch v\u00e1\u0161 sm\u011brova\u010d poslal nebo p\u0159ijal zpr\u00e1vu v posledn\u00edch n\u011bkolika minut\u00e1ch. Tento po\u010det se m\u016f\u017ee pohybovat od 8-10 a\u017e po n\u011bkolik set, v z\u00e1vislosti na celkov\u00e9m \u0161\u00ed\u0159en\u00ed p\u00e1sma, sd\u00edlen\u00e9m \u0161\u00ed\u0159eni p\u00e1sma a lok\u00e1ln\u011b generovan\u00e9 komunikaci. Druh\u00e9 \u010d\u00edslo zobrazuje po\u010det jin\u00fdch uzl\u016f, kter\u00e9 byly vid\u011bny za posledn\u00ed hodinu nebo takov\u00fd \u010dasov\u00fd \u00fasek. Nezoufejte, pokud se tyto \u010d\u00edsla v\u00fdrazn\u011b li\u0161\u00ed. <a href='/configstats#router.activePeers'>[Povolit grafy]</a>.";
