    t[878] = "This setting permits disabling SSU tests to determine if your router is firewalled and can be enabled for routers that are definitely not firewalled but are experiencing intermittent firewalling issues. In the event that testing is disabled, both SSU and NTCP should report your current public ip address on <a href=/info>the router info page</a>. [Restart required]";
    t[879] = "Toto nastaven\u00ed umo\u017e\u0148uje deaktivovat testy SSU, aby se zjistilo, zda je v\u00e1\u0161 sm\u011brova\u010d chr\u00e1n\u011bn firewallem, a m\u016f\u017ee b\u00fdt povoleno pro sm\u011brova\u010de, kter\u00e9 jsou ur\u010dit\u011b bez firewalu, ale maj\u00ed probl\u00e9my s p\u0159eru\u0161ovan\u00fdm blokov\u00e1n\u00edm firewallu. Pokud jsou testy zak\u00e1z\u00e1ny, m\u011bly by oba protokoly SSU a NTCP hl\u00e1sit va\u0161i aktu\u00e1ln\u00ed ve\u0159ejnou IP adresu na <a href=/info>str\u00e1nce s informacemi o sm\u011brova\u010di</a>. [Je vy\u017eadov\u00e1n restart]";
