    t[1062] = "When set to true, accessing the router console via http:// when https:// is enabled will automatically redirect to https. To configure router console access, edit the settings in your <code>clients.config</code> file in your profile directory (<i>not</i> the application installation directory). [Enabled by default]";
    t[1063] = "Kdy\u017e je nastaveno na true, p\u0159\u00edstup k routerov\u00e9 konzoli pomoc\u00ed protokolu http://, kdy\u017e je povoleno https://, bude automaticky p\u0159esm\u011brov\u00e1n na https. Pro konfiguraci p\u0159\u00edstupu ke konzoli routeru upravte nastaven\u00ed ve sv\u00e9m souboru <code>clients.config</code> ve va\u0161em profilov\u00e9m adres\u00e1\u0159i (<i>nikoliv</i> adres\u00e1\u0159 instalace aplikace). [V\u00fdchoz\u00ed hodnota je zapnuta]";
