    t[1174] = "Unless an outproxy has been set up for the service you want to connect to, this is not possible, with the exception of BitTorrent (see below). There are only three types of outproxies running right now: HTTP, HTTPS, and email. Note that there is currently no publicly listed SOCKS outproxy. If this type of service is required, try <a href=https://torproject.org/ target=_blank rel=noreferrer class='sitelink external'>Tor</a>.";
    t[1175] = "Pokud pro slu\u017ebu, ke kter\u00e9 se chcete p\u0159ipojit, nebyl nastaven outproxy, nen\u00ed toto mo\u017en\u00e9, s v\u00fdjimkou BitTorrentu (viz n\u00ed\u017ee). V sou\u010dasn\u00e9 dob\u011b jsou spu\u0161t\u011bny pouze t\u0159i typy outproxy: HTTP, HTTPS a e-mail. V\u0161imn\u011bte si, \u017ee v sou\u010dasn\u00e9 dob\u011b nen\u00ed ve\u0159ejn\u011b vyps\u00e1n \u017e\u00e1dn\u00fd SOCKS outproxy. Pokud je tato slu\u017eba po\u017eadov\u00e1na, zkuste <a href=https://torproject.org/ target=_blank rel=noreferrer class='sitelink external'>Tor</a>.";
