    t[1208] = "Watching Big Tech...";
    t[1209] = "Sledov\u00e1n\u00ed Big Tech...";
    t[1212] = "The skew (offset) of your computer's clock relative to the network-synced time (if known). I2P requires your computer's time be accurate. If the skew is more than a few seconds, please correct the problem by adjusting your computer's time. If I2P cannot connect to the internet, a reading of 0ms may be indicated. Note: This is only displayed in the <i>Router Information (advanced)</i> section. You may add this section to your Sidebar on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[1213] = "Posun (offset) \u010dasu va\u0161eho po\u010d\u00edta\u010de vzhledem k s\u00ed\u0165ov\u011b synchronizovan\u00e9mu \u010dasu (je-li zn\u00e1m). I2P vy\u017eaduje p\u0159esnost \u010dasu va\u0161eho po\u010d\u00edta\u010de. Pokud je posun v\u011bt\u0161\u00ed ne\u017e n\u011bkolik sekund, opravte probl\u00e9m nastaven\u00edm \u010dasu na sv\u00e9m po\u010d\u00edta\u010di. Pokud se I2P nep\u0159ipoj\u00ed k internetu, m\u016f\u017ee se zobrazit \u010dten\u00ed 0 ms. Pozn\u00e1mka: Toto je zobrazeno pouze v \u010d\u00e1sti <i>Informa\u010dn\u00ed sm\u011brova\u010de (pokro\u010dil\u00e9)</i>. Tuto \u010d\u00e1st m\u016f\u017eete p\u0159idat do bo\u010dn\u00edho panelu na str\u00e1nce <a href='/configsidebar'>Konfigurace bo\u010dn\u00edho panelu</a>.";
    t[1224] = "Sort by inbound rate";
