    t[1272] = "To migrate the key to a new router, or to setup multihoming (running the same service on multiple routers for redundancy and load-balancing), copy the backed up key to your .i2p directory and specify it in the new server tunnel, or replace the default key in the plugin folder (e.g. the zzzot plugin).";
    t[1273] = "Chcete-li p\u0159en\u00e9st kl\u00ed\u010d do nov\u00e9ho sm\u011brova\u010de nebo nastavit v\u00edcehosting (spou\u0161t\u011bn\u00ed stejn\u00e9 slu\u017eby na v\u00edce sm\u011brova\u010d\u00edch pro redundantnost a vyv\u00e1\u017een\u00ed z\u00e1t\u011b\u017ee), zkop\u00edrujte z\u00e1lohovan\u00fd kl\u00ed\u010d do sv\u00e9ho adres\u00e1\u0159e .i2p a nastavte jej v nov\u00e9m serverov\u00e9m tunelu nebo nahra\u010fte v\u00fdchoz\u00ed kl\u00ed\u010d ve slo\u017ece pluginu (nap\u0159. plugin zzzot).";
    t[1276] = "Configuration";
