    t[1298] = "This setting permits an expiry time to be configured (in seconds) for bans enforced via blocklists. By default bans persist for the duration of the router session. [Restart required]";
    t[1299] = "Toto nastaven\u00ed umo\u017e\u0148uje nastavit \u010das vypr\u0161en\u00ed (v sekund\u00e1ch) pro bans prosazen\u00e9 pomoc\u00ed blocklist\u016f. Ve v\u00fdchoz\u00edm nastaven\u00ed bans trvaj\u00ed po celou dobu trv\u00e1n\u00ed relace sm\u011brova\u010de. [Vy\u017eadov\u00e1n restart]";
