    t[1351] = "Pokud se zd\u00e1, \u017ee I2P vyu\u017e\u00edv\u00e1 p\u0159\u00edli\u0161 mnoho pam\u011bti RAM, m\u016f\u017eete sm\u011brova\u010d p\u0159inutit, aby spustil rutinu garbage collection, aby se uvolnila pam\u011b\u0165.";
