    t[1462] = "How long an outbound message waits in the queue. This should generally be a few hundred milliseconds or less. If it is consistently higher than 1000ms, your computer is very slow, or you should adjust your bandwidth limits, or your (BitTorrent?) clients may be sending too much data and should have their transmit bandwidth limit reduced. <a href='/configstats#transport.sendProcessingTime'>[Enable graphing]</a> (transport.sendProcessingTime).";
    t[1463] = "Jak dlouho z\u016fst\u00e1v\u00e1 odchoz\u00ed zpr\u00e1va ve front\u011b. Obvykle by to m\u011blo b\u00fdt n\u011bkolik set milisekund nebo m\u00e9n\u011b. Pokud je pravideln\u011b vy\u0161\u0161\u00ed ne\u017e 1000 ms, v\u00e1\u0161 po\u010d\u00edta\u010d je velmi pomal\u00fd, m\u011bli byste p\u0159izp\u016fsobit limity \u0161\u00ed\u0159ky p\u00e1sma, va\u0161i (BitTorrent?) klienti mohou pos\u00edlat p\u0159\u00edli\u0161 mnoho dat a m\u011bli byste sn\u00ed\u017eit jejich limit p\u0159enosov\u00e9ho p\u00e1sma. <a href='/configstats#transport.sendProcessingTime'>[Povolit grafy]</a> (transport.sendProcessingTime).";
