    t[2196] = "Abridged I2P FAQ";
    t[2197] = "Zkr\u00e1cen\u00fd I2P FAQ";
    t[2206] = "Version";
    t[2207] = "Verze";
    t[2210] = "I2P selects a random port between 9000 and 31000 to communicate with other routers when the program is run for the first time, or when your external IP address changes when running in <a href=/confignet#ipchange>Laptop Mode</a>. The <a href=/confignet#udpconfig>selected port</a> is shown on the <a href=/confignet>Network Configuration page</a>.";
    t[2211] = "P\u0159i prvn\u00edm spu\u0161t\u011bn\u00ed programu I2P vybere n\u00e1hodn\u00fd port mezi 9000 a 31000 pro komunikaci s ostatn\u00edmi routery, nebo p\u0159i zm\u011bn\u011b va\u0161\u00ed extern\u00ed IP adresy p\u0159i spu\u0161t\u011bn\u00ed v re\u017eimu <a href=/confignet#ipchange>Laptop Mode</a>. <a href=/confignet#udpconfig>Vybran\u00fd port</a> je zobrazen na <a href=/confignet>str\u00e1nce s konfigurac\u00ed s\u00edt\u011b</a>.";
    t[2212] = "Message send rate (B/s)";
