    t[2236] = "midnight";
    t[2237] = "p\u016flnoc";
    t[2246] = "A gentle introduction to I2P";
    t[2247] = "Jemn\u00fd \u00favod do I2P";
    t[2250] = "How long jobs are waiting before execution. The job queue is listed on the <a href='/jobs'>Jobs page</a>. Unfortunately, there are several other job queues in the router that may be congested, and their status is not available in the router console. The job lag should generally be zero. If it is consistently higher than 500ms, your computer is very slow, your network is experiencing connectivity issues, or the router has serious problems. <a href='/configstats#jobQueue.jobLag'>[Enable graphing]</a>.";
    t[2251] = "Jak dlouho \u00fakoly \u010dekaj\u00ed p\u0159ed proveden\u00edm. Fronta \u00fakol\u016f je uvedena na str\u00e1nce <a href='/jobs'>\u00dakoly</a>. Bohu\u017eel existuje n\u011bkolik dal\u0161\u00edch front s \u00fakoly v routeru, kter\u00e9 mohou b\u00fdt zahlcov\u00e1ny, a jejich stav nen\u00ed dostupn\u00fd v routerov\u00e9 konzoli. Zpo\u017ed\u011bn\u00ed \u00faloh by obecn\u011b m\u011blo b\u00fdt nulov\u00e9. Pokud je pravideln\u011b vy\u0161\u0161\u00ed ne\u017e 500 ms, v\u00e1\u0161 po\u010d\u00edta\u010d je velmi pomal\u00fd, va\u0161e s\u00ed\u0165 m\u00e1 probl\u00e9my s p\u0159ipojen\u00edm nebo router m\u00e1 v\u00e1\u017en\u00e9 probl\u00e9my. <a href='/configstats#jobQueue.jobLag'>[Povolit grafy]</a>.";
    t[2252] = "Configure I2P Updates";
    t[2253] = "Konfigurace I2P aktualizac\u00ed";
    t[2254] = "Before you tell the world about your new website, you should add some content. Go to the server's root directory <a href=#rootdir>listed above</a> and replace the <i>index.html</i> redirect page with your own content. If you need a template for a basic site, feel free to adapt <a href=http://127.0.0.1:7658/help/pagetemplate.html>this page</a>. If you're returned to this page after editing the content, try clearing your browser's web cache.";
    t[2255] = "Ne\u017e ozn\u00e1m\u00edte sv\u011btu sv\u016fj nov\u00fd web, m\u011bli byste p\u0159idat n\u011bjak\u00fd obsah. P\u0159ejd\u011bte do ko\u0159enov\u00e9ho adres\u00e1\u0159e serveru, kter\u00fd je <a href=#rootdir>v\u00fd\u0161e uveden</a> a nahra\u010fte str\u00e1nku p\u0159esm\u011brov\u00e1n\u00ed <i>index.html</i> sv\u00fdm vlastn\u00edm obsahem. Pokud pot\u0159ebujete \u0161ablonu pro z\u00e1kladn\u00ed str\u00e1nky, klidn\u011b si zdaptujte <a href=http://127.0.0.1:7658/help/pagetemplate.html>tuto str\u00e1nku</a>. Pokud se po \u00faprav\u011b obsahu vr\u00e1t\u00edte zp\u011bt na tuto str\u00e1nku, zkuste smazat webovou mezipam\u011b\u0165 va\u0161eho prohl\u00ed\u017ee\u010de.";
