    t[2295] = "Pr\u00e1h <i class=example>default</i> se vztahuje na jak\u00e9koli vzd\u00e1len\u00e9 m\u00edsto, kter\u00e9 nen\u00ed explicitn\u011b uvedeno v definici nebo v \u017e\u00e1dn\u00e9m ze soubor\u016f odkazovan\u00fdch. Pro nastaven\u00ed v\u00fdchoz\u00edho prahu pou\u017eijte kl\u00ed\u010dov\u00e9 slovo <i class=example>default</i>.";
