    t[2311] = "Po\u0161li d\u00e1l";
    t[2312] = "If your router has 10 or more active peers, everything is fine. The router should maintain connections to a few peers at all times. The best way to stay \"better-connected\" to the network is to <a href=/config>share more bandwidth</a>.";
    t[2313] = "Pokud v\u00e1\u0161 router m\u00e1 10 nebo v\u00edce aktivn\u00edch vrstevn\u00edk\u016f, je v\u0161e v po\u0159\u00e1dku. Router by m\u011bl udr\u017eovat spojen\u00ed s n\u011bkolika vrstevn\u00edky neust\u00e1le. Nejlep\u0161\u00ed zp\u016fsob, jak z\u016fstat 'l\u00e9pe p\u0159ipojen\u00fd' k s\u00edti, je <a href=/config>sdsahovat v\u00edce \u0161\u00ed\u0159ky p\u00e1sma</a>.";
    t[2320] = "Not enough shared bandwidth to build transit tunnels.";
    t[2321] = "Nedostatek sd\u00edlen\u00e9 \u0161\u00ed\u0159ky p\u00e1sma pro vybudov\u00e1n\u00ed tranzitn\u00edch tunel\u016f.";
