    t[2370] = "Glossary";
    t[2371] = "Glos\u00e1\u0159";
    t[2376] = "To obtain your own hostname, I2P domain registrars such as <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> or <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a> provide registration services that allow you to register and manage an .i2p hostname or sub-domain which will then be propagated across the network. Some registration sites will require the <i>B64 destination address</i> for the tunnel/service you wish to associate with a hostname, which you should copy from the <i>Local destination</i> section on the <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>.";
    t[2377] = "Pro z\u00edsk\u00e1n\u00ed vlastn\u00edho hostname mohou I2P dom\u00e9nov\u00ed registr\u00e1to\u0159i, jako nap\u0159\u00edklad <a href=http://stats.i2p/i2p/addkey.html target=_blank rel=noreferrer class=sitelink>stats.i2p</a> nebo <a href=http://reg.i2p/ target=_blank rel=noreferrer class=sitelink>reg.i2p</a>, poskytovat registra\u010dn\u00ed slu\u017eby, kter\u00e9 umo\u017e\u0148uj\u00ed registrovat a spravovat hostname nebo subdom\u00e9nu .i2p, kter\u00e9 se pot\u00e9 budou \u0161\u00ed\u0159it po s\u00edti. N\u011bkter\u00e9 registra\u010dn\u00ed str\u00e1nky mohou vy\u017eadovat <i>B64 c\u00edlovou adresu</i> pro tunel/sluzby, kterou si p\u0159ejete p\u0159i\u0159adit k hostname, co\u017e byste m\u011bli zkop\u00edrovat z \u010d\u00e1sti <i>Lok\u00e1ln\u00ed c\u00edl</i> na str\u00e1nce <a href='http://127.0.0.1:7657/i2ptunnel/edit?tunnel=3'>Konfigurace spr\u00e1vce tunel\u016f</a>.";
