    t[2470] = "Manual Peer Controls";
    t[2471] = "Ru\u010dn\u00ed ovl\u00e1d\u00e1n\u00ed Peer Controls";
    t[2482] = "This indicates the amount of RAM I2P is using, and the total amount available, allocated by Java. If the usage is consistently high relative to the available RAM, this may indicate that you need to increase the ram allocated to the JVM. You can allocate more RAM by editing your <code>wrapper.config</code> file which is normally located in the I2P application directory. You will need to edit the <code>wrapper.java.maxmemory</code> parameter, which by default is set to 256(MB) for I2P, or 384 for I2P+. Note: if the memory bar is enabled, the memory entry in the router info section will be suppressed.";
    t[2483] = "To ud\u00e1v\u00e1 mno\u017estv\u00ed pam\u011bti RAM, kterou I2P pou\u017e\u00edv\u00e1, a celkov\u00e9 mno\u017estv\u00ed k dispozici, kter\u00e9 je p\u0159id\u011bleno Javou. Pokud je vyu\u017eit\u00ed konzistentn\u011b vysok\u00e9 ve srovn\u00e1n\u00ed s dostupnou pam\u011bt\u00ed RAM, m\u016f\u017ee to nazna\u010dovat, \u017ee je nutn\u00e9 zv\u00fd\u0161it p\u0159id\u011blenou RAM pro JVM. V\u00edce RAM m\u016f\u017eete p\u0159id\u011blit \u00fapravou va\u0161eho souboru <code>wrapper.config</code>, kter\u00fd by obvykle m\u011bl b\u00fdt um\u00edst\u011bn v adres\u00e1\u0159i aplikace I2P. Budete muset upravit parametr <code>wrapper.java.maxmemory</code>, kter\u00fd je ve v\u00fdchoz\u00edm nastaven\u00ed nastaven na 256 (MB) pro I2P nebo 384 pro I2P+. Pozn\u00e1mka: Pokud je povolena pam\u011b\u0165ov\u00e1 li\u0161ta, z\u00e1znam o pam\u011bti v \u010d\u00e1sti informac\u00ed o sm\u011brova\u010di bude potla\u010den.";
