    t[2573] = "Plugin bude nainstalov\u00e1n p\u0159i p\u0159\u00ed\u0161t\u00edm restartu.";
    t[2578] = "Many of the stats on the sidebar may be <a href='/configstats'>configured</a> to be <a href='/graphs'>graphed</a> for further analysis. You may also customize the sections that appear on the Sidebar and their positioning on the <a href='/configsidebar'>Sidebar Configuration page</a>.";
    t[2579] = "Mnoho statistik na postrann\u00ed li\u0161t\u011b lze <a href='/configstats'>nastavit</a> pro dal\u0161\u00ed anal\u00fdzu. M\u016f\u017eete tak\u00e9 p\u0159izp\u016fsobit sekce, kter\u00e9 se zobrazuj\u00ed na postrann\u00ed li\u0161t\u011b, a jejich um\u00edst\u011bn\u00ed na str\u00e1nce <a href='/configsidebar'>konfigurace postrann\u00ed li\u0161ty</a>.";
    t[2582] = "This tunnel-specific setting allows you to enable or disable replies to pings sent to servers hosted by the router. To disable pings, you must add the line <code>i2p.streaming.answerPings=false</code> to the <i>Custom Options</i> section for the server's configuration in the Tunnel Manager.";
    t[2583] = "Toto specifick\u00e9 nastaven\u00ed tunelu v\u00e1m umo\u017e\u0148uje povolit nebo zak\u00e1zat odpov\u011bdi na odes\u00edlan\u00e9 pingy do server\u016f hostovan\u00fdch sm\u011brova\u010dem. Pokud chcete pingy zak\u00e1zat, mus\u00edte do konfigurace serveru v Tunelov\u00e9m spr\u00e1vci p\u0159idat \u0159\u00e1dek <code>i2p.streaming.answerPings=false</code> do sekce <i>Vlastn\u00ed mo\u017enosti</i>.";
    t[2592] = "Max";
    t[2593] = "Max";
    t[2598] = "If you wish to install unsigned (.zip) I2P updates, this should be added to your <code>router.config</code> file unless you have already configured <code>routerconsole.advanced=true</code>, in which case this option is already provisioned. Note: as of I2P+ 0.9.48+, installation of <a href=/configupdate#i2pupdates>unsigned updates</a> is enabled by default.";
    t[2599] = "Pokud si p\u0159ejete instalovat nepodepsan\u00e9 (.zip) aktualizace I2P, m\u011bla by b\u00fdt tato mo\u017enost p\u0159id\u00e1na do souboru <code>router.config</code>, pokud ji\u017e nem\u00e1te nakonfigurov\u00e1no <code>routerconsole.advanced=true</code>, v takov\u00e9m p\u0159\u00edpad\u011b je tato mo\u017enost ji\u017e zaji\u0161t\u011bna. Pozn\u00e1mka: od I2P+ verze 0.9.48+ je instalace <a href=/configupdate#i2pupdates>nepodepsan\u00fdch aktualizac\u00ed</a> implicitn\u011b povolena.";
    t[2600] = "Plugin {0} installed";
