    t[2609] = "Sou\u010dasn\u00e1 extern\u00ed IP adresa hl\u00e1\u0161en\u00e1 UPnP je {0}";
    t[2616] = "If you know and trust somebody that runs I2P, ask them to send you a reseed file generated using this page in their router console. Then, select the <i>Reseed from file</i> option on the {0} using the file you received.";
    t[2617] = "Pokud zn\u00e1te a d\u016fv\u011b\u0159ujete n\u011bkomu, kdo pou\u017e\u00edv\u00e1 I2P, po\u017e\u00e1dejte ho, aby v\u00e1m poslal soubor se znovuzasa\u017een\u00edm vygenerovan\u00fd pomoc\u00ed t\u00e9to str\u00e1nky v konzoli sv\u00e9ho sm\u011brova\u010de. Pot\u00e9 ve {0} vyberte mo\u017enost <i>Reseed from file</i> a pou\u017eijte p\u0159ijat\u00fd soubor.";
    t[2620] = "To enable session-only changes to the client tunnels, activate the console's <a href=\"/help/advancedsettings\">Advanced mode</a>.";
    t[2621] = "Chcete-li povolit zm\u011bny v klientsk\u00fdch tunelech pouze pro relaci, aktivujte <a href=\"/help/advancedsettings\">Pokro\u010dil\u00fd re\u017eim</a> konzoly.";
