    t[2682] = "WAN Ethernet Link Configuration";
    t[2683] = "WAN Ethernet Link Nastaven\u00ed";
    t[2696] = "This setting (in seconds) allows you to override the delay between runs of the Peer Exploration Job which attempts to locate new peers to add to the NetDb. The job will run every 80 seconds by default, or if the router is experiencing job or message lag, every 3 minutes. If the size of the NetDb reaches 4000 peers, the pause will increase to 15 minutes. You may wish to increase the delay if your NetDb is well-populated (over 2000 peers), or if you wish to reduce overall bandwidth usage. Note: For Floodfill routers, this job does not run.";
    t[2697] = "Toto nastaven\u00ed (ve vte\u0159in\u00e1ch) umo\u017e\u0148uje p\u0159epsat zpo\u017ed\u011bn\u00ed mezi spu\u0161t\u011bn\u00edmi \u00falohy prozkoum\u00e1v\u00e1n\u00ed vrstvy Peer, kter\u00e1 se sna\u017e\u00ed naj\u00edt nov\u00e9 peery ke p\u0159id\u00e1n\u00ed do s\u00edt\u011b NetDb. \u00daloha b\u011b\u017e\u00ed v\u00fdchoz\u00ed hodnoty ka\u017ed\u00fdch 80 sekund nebo, jestli\u017ee router m\u00e1 zpo\u017ed\u011bn\u00ed \u00faloh nebo zpr\u00e1v, ka\u017ed\u00e9 3 minuty. Pokud dos\u00e1hne velikost s\u00edt\u011b NetDb 4 000 peer\u016f, p\u0159est\u00e1vka se zv\u00fd\u0161\u00ed na 15 minut. Pokud je va\u0161e s\u00ed\u0165 NetDb dob\u0159e obsazen\u00e1 (v\u00edce ne\u017e 2 000 peer\u016f) nebo pokud chcete sn\u00ed\u017eit celkovou \u0161\u00ed\u0159ku p\u00e1sma, m\u016f\u017eete zv\u00fd\u0161it pauzu. Pozn\u00e1mka: Tato \u00faloha se neprovede u router\u016f pro zaplaven\u00ed.";
    t[2698] = "Current";
    t[2699] = "Aktu\u00e1ln\u00ed";
    t[2720] = "A website hosted on the I2P network. By default, a <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty webserver</a> is configured and running on <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2721] = "Webov\u00e1 str\u00e1nka hostovan\u00e1 v s\u00edti I2P. Ve v\u00fdchoz\u00edm nastaven\u00ed je nakonfigurov\u00e1n a spu\u0161t\u011bn webov\u00fd server <a href=https://www.eclipse.org/jetty/about.html class='sitelink external' target=_blank rel=noreferrer>Jetty</a> na <a href=http://127.0.0.1:7658/ target=_blank rel=noreferrer>http://127.0.0.1:7658/</a>.";
    t[2722] = "Can be disabled or changed in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Can also be configured to bind to a specific interface or all interfaces.";
    t[2723] = "Lze zak\u00e1zat nebo zm\u011bnit v <a href=/i2ptunnelmgr> Spr\u00e1vce tunel\u016f </a>. Lze tak\u00e9 nakonfigurovat k nav\u00e1z\u00e1n\u00ed na konkr\u00e9tn\u00ed rozhran\u00ed nebo na v\u0161echna rozhran\u00ed.";
    t[2728] = "I2P+ Service now enabled on system start";
    t[2729] = "Slu\u017eba I2P je nyn\u00ed povolena p\u0159i startu syst\u00e9mu";
    t[2748] = "Computer related news aggregation";
    t[2749] = "Agregace zpr\u00e1v souvisej\u00edc\u00edch s po\u010d\u00edta\u010dem";
    t[2752] = "Same IP as us";
    t[2753] = "Stejn\u00e1 IP jako my";
    t[2754] = "You may create a new router family here. Once you have created the family, you may export the family key file and share with other routers in your nominated family.";
    t[2755] = "Zde m\u016f\u017eete vytvo\u0159it novou rodinu router\u016f. ";
    t[2756] = "Tunnels peer has agreed to participate in";
    t[2757] = "Spole\u010dnost Tunnels souhlasila s \u00fa\u010dast\u00ed";
    t[2758] = "Advanced Lookup";
    t[2759] = "Pokro\u010dil\u00e9 vyhled\u00e1v\u00e1n\u00ed";
    t[2766] = "In order to access websites hosted on I2P, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P HTTP proxy, by default running on <code>127.0.0.1 port 4444</code>. Most browsers offer an option to configure your proxy; in this mini-tutorial we'll focus on Firefox.";
    t[2767] = "Abyste mohli p\u0159istupovat k webov\u00fdm str\u00e1nk\u00e1m hostovan\u00fdm na I2P a p\u0159\u00edpadn\u011b pou\u017e\u00edt v\u00fdchoz\u00ed outproxy pro p\u0159ipojen\u00ed k web\u016fm na clearnet, budete muset nakonfigurovat sv\u016fj prohl\u00ed\u017ee\u010d tak, aby pou\u017e\u00edval I2P HTTP proxy, ve v\u00fdchoz\u00edm nastaven\u00ed b\u011b\u017e\u00ed na <code>127.0.0.1 port 4444</code>. V\u011bt\u0161ina prohl\u00ed\u017ee\u010d\u016f nab\u00edz\u00ed mo\u017enost konfigurace proxy; v tomto minitutori\u00e1lu se zam\u011b\u0159\u00edme na Firefox.";
    t[2776] = "Close to us";
    t[2777] = "Bl\u00edzko n\u00e1s";
    t[2790] = "I2P+ Router Sitemap";
    t[2791] = "Mapa str\u00e1nek I2P+ Routeru";
    t[2794] = "Downloaded plugin version {0} is not newer than installed plugin";
    t[2795] = "Sta\u017een\u00e1 verze pluginu {0} nen\u00ed nov\u011bj\u0161\u00ed ne\u017e nainstalovan\u00fd plugin";
    t[2796] = "Streaming radio service";
    t[2797] = "Streamov\u00e1n\u00ed r\u00e1diov\u00e9 slu\u017eby";
    t[2798] = "I2P+ functions best when you can accurately reflect the speed of your network connection in the <a href=/config>bandwidth configuration section</a>. By default I2P+ is configured with some fairly conservative values that will not suit many use cases, so please take time to review these settings and correct where necessary. The more bandwidth you allocate, <i>specifically</i> upstream bandwidth, the more you will benefit from the network.";
    t[2799] = "I2P+ funguje nejl\u00e9pe, kdy\u017e m\u016f\u017eete p\u0159esn\u011b zobrazit rychlost va\u0161eho s\u00ed\u0165ov\u00e9ho p\u0159ipojen\u00ed v sekci konfigurace \u0161\u00ed\u0159ky p\u00e1sma. I2P+ je v\u00fdchoz\u00edm nastaven\u00edm s n\u011bkter\u00fdmi pom\u011brn\u011b konzervativn\u00edmi hodnotami, kter\u00e9 nebudou vyhovovat mnoha pou\u017eit\u00edm, tak\u017ee si pros\u00edm vezm\u011bte \u010das a zkontrolujte tyto nastaven\u00ed a opravte je, pokud je to nutn\u00e9. \u010c\u00edm v\u00edce \u0161\u00ed\u0159ky p\u00e1sma p\u0159id\u011bl\u00edte, zejm\u00e9na \u0161\u00ed\u0159ky p\u00e1sma sm\u011brem nahoru, t\u00edm v\u00edce se budete moci t\u011b\u0161it z s\u00edt\u011b.";
    t[2810] = "Transit by Peer";
    t[2811] = "Transit p\u0159es peer";
    t[2812] = "Hidden Mode";
    t[2813] = "Skryt\u00fd re\u017eim";
    t[2814] = "Plugin requires Jetty version {0} or lower";
    t[2815] = "Plugin vy\u017eaduje verzi Jetty {0} nebo ni\u017e\u0161\u00ed";
    t[2822] = "The proxy may be remotely hosted or a service running on your computer (localhost/127.0.0.1).";
    t[2823] = "Proxy m\u016f\u017ee b\u00fdt vzd\u00e1len\u011b hostov\u00e1n nebo m\u016f\u017ee b\u00fdt na va\u0161em po\u010d\u00edta\u010di spu\u0161t\u011bna slu\u017eba (localhost/127.0.0.1).";
    t[2824] = "Events in peak period";
    t[2825] = "Ud\u00e1losti ve \u0161pi\u010dce";
    t[2838] = "Router Console &amp; WebApps Display Language";
    t[2839] = "Jazyk zobrazen\u00ed ovl\u00e1dac\u00edho pultu sm\u011brova\u010de a webov\u00fdch aplikac\u00ed";
    t[2844] = "What to do in the event I2P+ isn't working";
    t[2845] = "Co d\u011blat v p\u0159\u00edpad\u011b, \u017ee I2P nefunguje";
    t[2856] = "ANONYMITY WARNING - Settings include 1-hop tunnels.";
    t[2857] = "ANONYMITY WARNING - Nastaven\u00ed zahrnuje 1-hop tunely.";
    t[2858] = "I2P IRC Network";
    t[2859] = "I2P IRC s\u00ed\u0165";
    t[2864] = "pixels wide";
    t[2865] = "\u0161\u00ed\u0159ka pixel\u016f";
    t[2882] = "The I2P Network Protocol (I2NP) manages the routing and mixing of messages between routers, in addition to the transport selection (where more than one is supported) when communicating with a peer. For more information, see the <a href=https://geti2p.net/en/docs/protocol/i2np class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[2883] = "Protokol I2P Network Protocol (I2NP) spravuje sm\u011brov\u00e1n\u00ed a m\u00edch\u00e1n\u00ed zpr\u00e1v mezi sm\u011brova\u010di, v\u010detn\u011b v\u00fdb\u011bru p\u0159enosu (pokud je podporov\u00e1no v\u00edce prost\u0159edk\u016f) p\u0159i komunikaci s ostatn\u00edmi sm\u011brova\u010di. Dal\u0161\u00ed informace naleznete v <a href=https://geti2p.net/en/docs/protocol/i2np>online dokumentaci</a>.";
    t[2884] = "Expired {0} ago";
    t[2885] = "Platnost vypr\u0161ela p\u0159ed {0}";
    t[2892] = "Your router's status on accepting or rejecting requests from other routers to build a participating tunnel through your router. Your router may accept all requests, accept or reject a percentage of requests, or reject all requests for a number of reasons, to control the bandwidth and CPU demands and maintain capacity for local clients. <b>Note";
    t[2893] = "Stav va\u0161eho routeru p\u0159i p\u0159ij\u00edm\u00e1n\u00ed nebo odm\u00edt\u00e1n\u00ed \u017e\u00e1dost\u00ed od dal\u0161\u00edch router\u016f o vytvo\u0159en\u00ed \u00fa\u010dastnick\u00e9ho tunelu p\u0159es v\u00e1\u0161 router. V\u00e1\u0161 router m\u016f\u017ee p\u0159ijmout v\u0161echny \u017e\u00e1dosti, p\u0159ijmout nebo odm\u00edtnout procento \u017e\u00e1dost\u00ed nebo odm\u00edtnout v\u0161echny \u017e\u00e1dosti z r\u016fzn\u00fdch d\u016fvod\u016f, aby kontroloval \u0161\u00ed\u0159ku p\u00e1sma a v\u00fdpo\u010detn\u00ed po\u017eadavky a udr\u017eoval kapacitu pro m\u00edstn\u00ed klienty. <b>Pozn\u00e1mka";
    t[2902] = "Please contact a known trustworthy friend who has a running I2P router, and ask them for help with reseeding your I2P router. Request that they send you a reseed file exported from their running I2P router. It is vital that the file is exchanged over a secure channel, e.g. encrypted to avoid external tampering (PGP Sign, Encrypt and Verified with a trusted public key). The file itself is unsigned, so please accept files only from known trusted friends. Never import a reseed file if you cannot verify its source.";
    t[2903] = "Pros\u00edm kontaktujte zn\u00e1m\u00e9ho d\u016fv\u011bryhodn\u00e9ho p\u0159\u00edtele, kter\u00fd pou\u017e\u00edv\u00e1 b\u011b\u017e\u00edc\u00ed I2P router, a po\u017e\u00e1dejte ho o pomoc s op\u011btovn\u00fdm zasazen\u00edm va\u0161eho I2P routeru. Po\u017e\u00e1dejte ho, aby v\u00e1m poslal reseed soubor exportovan\u00fd z jeho b\u011b\u017e\u00edc\u00edho I2P routeru. Je d\u016fle\u017eit\u00e9, aby byl soubor vym\u011bn\u011bn p\u0159es bezpe\u010dn\u00fd kan\u00e1l, nap\u0159\u00edklad za\u0161ifrovan\u00fd, aby se zabr\u00e1nilo vn\u011bj\u0161\u00edmu z\u00e1sahu (PGP Sign, Encrypt a ov\u011b\u0159eno s d\u016fv\u011bryhodn\u00fdm ve\u0159ejn\u00fdm kl\u00ed\u010dem). Samotn\u00fd soubor nen\u00ed podepsan\u00fd, tak\u017ee p\u0159ij\u00edmejte soubory pouze od zn\u00e1m\u00fdch d\u016fv\u011bryhodn\u00fdch p\u0159\u00e1tel. Nikdy neimportujte reseed soubor, pokud nem\u016f\u017eete ov\u011b\u0159it jeho p\u016fvod.";
    t[2916] = "Last Good Send";
    t[2917] = "Posledn\u00ed dobr\u00e9 odesl\u00e1n\u00ed";
    t[2918] = "Delete this value to disable";
    t[2919] = "Odstran\u011bn\u00edm t\u00e9to hodnoty ji deaktivujete";
    t[2920] = "You can use a recorder in one tunnel that writes to a file that another tunnel, or multiple tunnels, can use for throttling. These files can also be edited by hand.";
    t[2921] = "M\u016f\u017eete pou\u017e\u00edt z\u00e1znamova\u010d v jednom tunelu, kter\u00fd zapisuje do souboru, kter\u00fd lze pou\u017e\u00edt pro \u00fatlum jin\u00e9ho tunelu nebo v\u00edce tunel\u016f. Tyto soubory lze tak\u00e9 ru\u010dn\u011b upravovat.";
    t[2924] = "Router running a non-native, software emulated version of the Java BigInteger library";
    t[2925] = "Sm\u011brova\u010d s nenativn\u00ed verz\u00ed knihovny Java BigInteger s emulac\u00ed softwaru";
