    t[2947] = "Ov\u011b\u0159en\u00e1 rodina (podpisov\u00fd certifik\u00e1t je nainstalov\u00e1n a platn\u00fd)";
    t[2954] = "Router info not available";
    t[2955] = "Informace o routeru nejsou k dispozici";
    t[2956] = "The Java web applications listed below are started by the webConsole client and run in the same JVM as the router. They are usually web applications accessible through the router console. They may be complete applications (e.g. i2psnark), front-ends to another client or application which must be separately enabled (e.g. susidns, i2ptunnel), or have no web interface at all (e.g. addressbook).";
    t[2957] = "N\u00ed\u017ee jsou uvedeny Java webov\u00e9 aplikace, kter\u00e9 jsou spu\u0161t\u011bny klientem webConsole a b\u011b\u017e\u00ed ve stejn\u00e9m JVM jako sm\u011brova\u010d. Obvykle se jedn\u00e1 o webov\u00e9 aplikace, kter\u00e9 jsou p\u0159\u00edstupn\u00e9 prost\u0159ednictv\u00edm konzole sm\u011brova\u010de. Mohou to b\u00fdt kompletn\u00ed aplikace (nap\u0159. i2psnark), rozhran\u00ed pro jin\u00e9ho klienta nebo aplikaci, kter\u00e1 je nutn\u00e9 samostatn\u011b povolit (nap\u0159. susidns, i2ptunnel), nebo nemaj\u00ed \u017e\u00e1dn\u00e9 webov\u00e9 rozhran\u00ed (nap\u0159. addressbook).";
    t[2960] = "WARNING - Inbound 0-hop tunnels not recommended for hidden routers.";
    t[2961] = "VAROV\u00c1N\u00cd - P\u0159\u00edchoz\u00ed 0-hop tunely se pro skryt\u00e9 sm\u011brova\u010de nedoporu\u010duj\u00ed.";
    t[2972] = "HTTP Proxy";
    t[2973] = "HTTP Proxy";
    t[2978] = "This is the total number of peers that are known by your router. They are listed on the <a href='/netdb'>Network Database page</a>. This may range from under 100 to 1000 or more. This number is not the total size of the network; it may vary widely depending on your total bandwidth, shared bandwidth, and locally-generated traffic. I2P does not require a router to know every other router in the network.";
    t[2979] = "Toto je celkov\u00fd po\u010det peer\u016f, kter\u00e9 jsou zn\u00e1my va\u0161\u00edm sm\u011brova\u010dem. Jsou uvedeni na str\u00e1nce <a href='/netdb'>Datab\u00e1ze s\u00edt\u011b</a>. Toto \u010d\u00edslo se m\u016f\u017ee pohybovat od m\u00e9n\u011b ne\u017e 100 do 1000 nebo v\u00edce. Toto \u010d\u00edslo nen\u00ed celkov\u00e1 velikost s\u00edt\u011b; mohlo by se v\u00fdrazn\u011b li\u0161it v z\u00e1vislosti na va\u0161\u00ed celkov\u00e9 propustnosti, sd\u00edlen\u00e9 propustnosti a m\u00edstn\u011b generovan\u00e9mu provozu. I2P nevy\u017eaduje, aby sm\u011brova\u010d znal ka\u017ed\u00fd jin\u00fd sm\u011brova\u010d v s\u00edti.";
