    t[3062] = "You can override the <a href=http://127.0.0.1:7658/help/images/>default appearance</a> of the directory listing by supplying an edited <a href=http://127.0.0.1:7658/.resources/jetty-dir.css>jetty-dir.css</a> file to set a global appearance. Note that this file will not be displayed in the webserver's directory listing. Files and directories prefixed with . and files named favicon.ico or files ending with ~ or .bak or .old will also be hidden from view (though still accessible). Note: To create hidden files with a . prefix on Windows, add a trailing . to the file or directory e.g. <code>.hidden.</code>; Windows explorer will then save the file with the correct name, removing the trailing dot in the process.";
    t[3063] = "M\u016f\u017eete p\u0159epsat <a href=http://127.0.0.1:7658/help/images/>v\u00fdchoz\u00ed vzhled</a> seznamu adres\u00e1\u0159\u016f t\u00edm, \u017ee poskytnete upraven\u00fd soubor <a href=http://127.0.0.1:7658/.resources/jetty-dir.css>jetty-dir.css</a> k nastaven\u00ed glob\u00e1ln\u00edho vzhledu. V\u0161imn\u011bte si, \u017ee tento soubor nebude zobrazen v seznamu adres\u00e1\u0159\u016f webov\u00e9ho serveru. Soubory a adres\u00e1\u0159e s prefixem . a soubory pojmenovan\u00e9 favicon.ico nebo soubory kon\u010d\u00edc\u00ed ~ nebo .bak nebo .old budou tak\u00e9 skryty zobrazen\u00ed (i kdy\u017e st\u00e1le p\u0159\u00edstupn\u00e9). Pozn\u00e1mka: Abyste na syst\u00e9mu Windows vytvo\u0159ili skryt\u00e9 soubory s prefixem ., p\u0159idejte k souboru nebo adres\u00e1\u0159i te\u010dku na konci, nap\u0159\u00edklad <code>.skryt\u00fd.</code>; Pr\u016fzkumn\u00edk soubor\u016f syst\u00e9mu Windows pak soubor ulo\u017e\u00ed se spr\u00e1vn\u00fdm n\u00e1zvem a odstran\u00ed te\u010dku na konci.";
