    t[3160] = "This is a shortened version of the official FAQ. For the full version, please visit <a href=https://geti2p.net/faq target=_blank rel=noreferrer class='sitelink external'>https://geti2p.net/faq</a> or <a href=http://i2p-projekt.i2p/faq target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p/faq</a>.";
    t[3161] = "Toto je zkr\u00e1cen\u00e1 verze ofici\u00e1ln\u00edho FAQ. Pro plnou verzi nav\u0161tivte pros\u00edm <a href=https://geti2p.net/faq target=_blank rel=noreferrer class='sitelink external'>https://geti2p.net/faq</a> nebo <a href=http://i2p-projekt.i2p/faq target=_blank rel=noreferrer class=sitelink>http://i2p-projekt.i2p/faq</a>.";
    t[3166] = "Total number of tunnels in use";
    t[3167] = "Celkov\u00fd po\u010det pou\u017e\u00edvan\u00fdch tunel\u016f";
    t[3188] = "When set to true, additional functionality will be enabled in the console and the user will be able to edit settings directly on the <a href=/configadvanced>Advanced Configuration page</a>. Extra display options are provided in the <a href=/netdb>Network Database section</a>, including the <a href='/netdb?f=3'>Sybil Analysis tool</a>, and there are additional configuration options on the <a href=/configclients>Clients Configuration page</a>. This will also enable the installation of unsigned updates, manual configuration of the news URL, and additional sections on the sidebar.";
    t[3189] = "Pokud je nastaveno na true, bude v konzoli povolena dal\u0161\u00ed funkcionalita a u\u017eivatel bude m\u00edt mo\u017enost p\u0159\u00edmo upravovat nastaven\u00ed na str\u00e1nce <a href=/configadvanced>Advanced Configuration</a>. V nab\u00eddce <a href=/netdb>Network Database</a> jsou k dispozici dal\u0161\u00ed mo\u017enosti zobrazen\u00ed v\u010detn\u011b n\u00e1stroje <a href='/netdb?f=3'>Sybil Analysis</a> a na str\u00e1nce <a href=/configclients>Clients Configuration</a> jsou k dispozici dal\u0161\u00ed konfigura\u010dn\u00ed mo\u017enosti. T\u00edmto se tak\u00e9 povol\u00ed instalace nesignovan\u00fdch aktualizac\u00ed, ru\u010dn\u00ed konfigurace URL zpr\u00e1v a dal\u0161\u00ed sekce na postrann\u00ed li\u0161t\u011b.";
