    t[3202] = "The following filter definition applies some throttling by default, no throttling for destinations in the file <i class=example>friends.txt</i>, forbids any connections from destinations in the file <i class=example>enemies.txt</i>, and logs any aggressive behavior in a file called <i class=example>suspicious.txt</i>:";
    t[3203] = "Tato filtruj\u00edc\u00ed definice v\u00fdchoz\u00edm zp\u016fsobem nepou\u017e\u00edv\u00e1 \u017e\u00e1dn\u00fd \u00fatlum pro destinace v souboru <i class=example>friends.txt</i>, zakazuje jak\u00e9koliv spojen\u00ed z destinac\u00ed v souboru <i class=example>enemies.txt</i> a zaznamen\u00e1v\u00e1 jak\u00e9koli agresivn\u00ed chov\u00e1n\u00ed do souboru s n\u00e1zvem <i class=example>suspicious.txt</i>:";
