    t[3322] = "A <a href=https://en.wikipedia.org/wiki/Base32 class='sitelink external' target=_blank rel=noreferrer>Base32</a> link (which always ends with .b32.i2p) is a hash of a <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external' target=_blank rel=noreferrer>Base64</a> destination. For services on the network, the Base64 hash is often mapped to an .i2p domain in the addressbook.";
    t[3323] = "Odkaz Base32 (<a href=https://en.wikipedia.org/wiki/Base32 class='sitelink external' target=_blank rel=noreferrer>B32</a>) (kter\u00fd v\u017edy kon\u010d\u00ed s .b32.i2p) je otisk odkazu Base64 (<a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external' target=_blank rel=noreferrer>B64</a>). Pro slu\u017eby v s\u00edti je \u010dasto otisk Base64 mapov\u00e1n na dom\u00e9nu .i2p ve slovn\u00edku adres.";
