    t[3486] = "This is the number of peers your router has available for building client tunnels. It is generally in the range 8-30. Your fast peers are shown on the <a href='/profiles'>Profiles page</a>. <a href='/configstats#router.fastPeers'>[Enable graphing]</a>";
    t[3487] = "Toto je po\u010det jin\u00fdch uzl\u016f, kter\u00e9 jsou va\u0161emu sm\u011brova\u010di k dispozici pro vytv\u00e1\u0159en\u00ed klientov\u00fdch tunel\u016f. Obvykle se pohybuje v rozmez\u00ed 8-30. Va\u0161i rychl\u00ed uzlov\u00e9 soused\u00e9 jsou zobrazeni na str\u00e1nce <a href='/profiles'>Profiles</a>. <a href='/configstats#router.fastPeers'>[Povolit grafy]</a>";
    t[3488] = "Click the <i>Reseed from File</i> button";
    t[3489] = "Klikn\u011bte na tla\u010d\u00edtko <i>Reseed from File</i>";
    t[3490] = "A variant of onion routing that encrypts multiple messages together to make it more difficult for attackers to perform traffic analysis and to increase the speed of data transfer. For more information, see the <a href=https://geti2p.net/en/docs/how/garlic-routing class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[3491] = "Variant routov\u00e1n\u00ed cibul\u00ed, kter\u00e1 \u0161ifruje v\u00edce zpr\u00e1v dohromady, aby bylo obt\u00ed\u017en\u011bj\u0161\u00ed pro \u00fato\u010dn\u00edky prov\u00e1d\u011bt anal\u00fdzu provozu a zv\u00fd\u0161it rychlost p\u0159enosu dat. Dal\u0161\u00ed informace naleznete v <a href=https://geti2p.net/en/docs/how/garlic-routing>online dokumentaci</a>.";
    t[3494] = "How to Harden Your WordPress Site";
    t[3495] = "Jak zabezpe\u010dit v\u00e1\u0161 web postaven\u00fd na WordPress";
    t[3496] = "I2P Internals";
    t[3497] = "Vnit\u0159n\u00ed za\u0159\u00edzen\u00ed I2P";
    t[3500] = "By default, I2P is supplied with a webserver to host your own anonymized website (traditionally referred to as an <i>eepsite</i>). Both the site and the I2P Router Console are running on a streamlined version of <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a>, customized for I2P.";
    t[3501] = "Ve v\u00fdchoz\u00edm nastaven\u00ed je I2P dod\u00e1v\u00e1no s webov\u00fdm serverem, kter\u00fd slou\u017e\u00ed k hostov\u00e1n\u00ed va\u0161ich vlastn\u00edch anonymizovan\u00fdch webov\u00fdch str\u00e1nek (tradi\u010dn\u011b ozna\u010dovan\u00fdch jako <i>eepsite</i>). S\u00e1m web a tak\u00e9 I2P Router konzole jsou provozov\u00e1ny na vylep\u0161en\u00e9 verzi webov\u00e9ho serveru <a href='https://en.wikipedia.org/wiki/Jetty_(web_server)' target=_blank rel=noreferrer class='sitelink external'>Jetty</a>, kter\u00e1 je p\u0159izp\u016fsobena pro I2P.";
    t[3504] = "This setting allows you to exclude older routers from your NetDb. Routers older than the default or the value you set will be deleted from the NetDb and banned for the duration of the router session. By default, routers older than 0.9.20 are excluded. Note: starting with I2P+ version 0.9.46+, only routers running very recent versions are used for building local tunnels. [Restart required]";
    t[3505] = "Tento parametr v\u00e1m umo\u017e\u0148uje vylou\u010dit star\u0161\u00ed routery ze souboru NetDb. Routery star\u0161\u00ed ne\u017e v\u00fdchoz\u00ed hodnota nebo hodnota, kterou nastav\u00edte, budou smaz\u00e1ny ze souboru NetDb a budou zak\u00e1z\u00e1ny po celou dobu b\u011bhu routeru. Standardn\u011b jsou vylou\u010deny routery star\u0161\u00ed ne\u017e 0.9.20. Pozn\u00e1mka: od verze I2P+ 0.9.46+ jsou pou\u017e\u00edv\u00e1ny pouze routery, kter\u00e9 b\u011b\u017e\u00ed na velmi nov\u00fdch verz\u00edch pro budov\u00e1n\u00ed lok\u00e1ln\u00edch tunel\u016f. [Vy\u017eaduje restart]";
