    t[3546] = "This setting, in milliseconds, overrides the default message processing time limit (indicated as <i>Message Delay</i> in the Congestion sidebar section) before the router is determined to be congested and transit tunnel requests are rejected. [Default is 750ms or 1500ms if the router is flagged as slow]";
    t[3547] = "Toto nastaven\u00ed v milisekund\u00e1ch p\u0159episuje v\u00fdchoz\u00ed \u010dasov\u00fd limit zpracov\u00e1n\u00ed zpr\u00e1v (uv\u00e1d\u011bn jako <i>Prodleva zpr\u00e1v</i> v bo\u010dn\u00edm panelu p\u0159et\u00ed\u017een\u00ed), ne\u017e je sm\u011brova\u010d stanoven jako p\u0159epln\u011bn a po\u017eadavky na tranzitn\u00ed tunel jsou odm\u00edtnuty. [V\u00fdchoz\u00ed hodnota je 750 ms nebo 1500 ms, pokud je sm\u011brova\u010d ozna\u010den jako pomal\u00fd]";
