    t[3619] = "ERR - Odchylka hodin";
    t[3624] = "This setting determines whether or not the router should use the provided <i>blocklist.txt</i> file and any user configured blocklists to enable banning of routers by hash or ip address. Ranges and net masks are supported for IPv4 but not IPv6. See the <i>blocklist.txt</i> in your I2P+ application directory for more info. [Enabled by default, restart required]";
    t[3625] = "Toto nastaven\u00ed ur\u010duje, zda router pou\u017e\u00edv\u00e1 poskytnut\u00fd soubor <i>blocklist.txt</i> a jak\u00e9koli u\u017eivatelsky nastaven\u00e9 blokovac\u00ed seznamy, aby umo\u017enil z\u00e1kazy router\u016f podle hash nebo IP adresy. Rozsahy a s\u00ed\u0165ov\u00e9 masky jsou podporov\u00e1ny pro IPv4, ale ne pro IPv6. Dal\u0161\u00ed informace naleznete v souboru <i>blocklist.txt</i> ve va\u0161em adres\u00e1\u0159i aplikace I2P+. [V\u00fdchoz\u00ed hodnota je zapnuta, je pot\u0159eba restartovat]";
