    t[3638] = "Outbound UDP on port 123, allowing replies: this is necessary for I2P's internal time sync (via SNTP - querying a random SNTP host in <code>pool.ntp.org</code> or <a href=/help/advancedsettings#ntpserverconfig>another server you specify</a>).";
    t[3639] = "V\u00fdstupn\u00ed UDP na portu 123 s mo\u017enost\u00ed odpov\u011bdi: to je nezbytn\u00e9 pro intern\u00ed \u010dasovou synchronizaci I2P (pomoc\u00ed SNTP - dotazov\u00e1n\u00ed n\u00e1hodn\u00e9ho hosta SNTP ve <code>pool.ntp.org</code> nebo <a href=/help/advancedsettings#ntpserverconfig>jin\u00e9 specifikovan\u00fd server</a>).";
    t[3646] = "NetDb Search";
