    t[3654] = "XChat-like client users can create a new network with the server <code>127.0.0.1/6668</code> (remember to tick <i>Bypass proxy server</i> if you have a proxy server configured), or you can connect with the command <code>/server 127.0.0.1 6668</code>. Different IRC clients may vary the syntax.";
    t[3655] = "U\u017eivatel\u00e9 klienta XChat-like mohou vytvo\u0159it novou s\u00ed\u0165 se serverem <code>127.0.0.1/6668</code> (nezapome\u0148te za\u0161krtnout <i>Obch\u00e1zet s\u00ed\u0165ov\u00fd proxy server</i>, pokud m\u00e1te nakonfigurovan\u00fd proxy server), nebo se lze p\u0159ipojit pomoc\u00ed p\u0159\u00edkazu <code>/server 127.0.0.1 6668</code>. Syntaxe se m\u016f\u017ee li\u0161it mezi r\u016fzn\u00fdmi klienty IRC.";
