    t[3704] = "The router configuration options listed below are not available in the user interface, usually because they are rarely used or provide access to advanced settings that most users will not need. This is not a comprehensive list. Some settings will require a restart of the router to take effect. Note that all settings are case sensitive. You will need to edit your <code>router.config</code> file to add options, or, once you have added <code>routerconsole.advanced=true</code> to the router.config file, you may edit settings within the console on the <a href=/configadvanced>Advanced Configuration page</a>.";
    t[3705] = "N\u00ed\u017ee uveden\u00e9 konfigura\u010dn\u00ed volby sm\u011brova\u010de nejsou dostupn\u00e9 v u\u017eivatelsk\u00e9m rozhran\u00ed, obvykle proto, \u017ee se z\u0159\u00eddka pou\u017e\u00edvaj\u00ed nebo poskytuj\u00ed p\u0159\u00edstup k pokro\u010dil\u00fdm nastaven\u00edm, kter\u00e1 v\u011bt\u0161ina u\u017eivatel\u016f nebude pot\u0159ebovat. Toto nen\u00ed vy\u010derp\u00e1vaj\u00edc\u00ed seznam. N\u011bkter\u00e1 nastaven\u00ed vy\u017eaduj\u00ed restart sm\u011brova\u010de pro jejich \u00fa\u010dinnost. V\u0161imn\u011bte si, \u017ee v\u0161echna nastaven\u00ed jsou rozli\u0161ov\u00e1na velikost\u00ed p\u00edsmen. K p\u0159id\u00e1n\u00ed mo\u017enost\u00ed budete muset upravit soubor <code>router.config</code> nebo, a\u017e p\u0159id\u00e1te <code>routerconsole.advanced=true</code> do souboru router.config, budete moci upravit nastaven\u00ed v konzoli na str\u00e1nce <a href=/configadvanced>roz\u0161\u00ed\u0159en\u00e9 konfigurace</a>.";
