    t[4054] = "In order to access websites hosted on the I2P network, and optionally use the default outproxy to connect to websites on clearnet, you will need to configure your browser to use the I2P+ <b>HTTP</b> proxy, by default running on <code>127.0.0.1 port 4444</code>. For more help, see <a href=https://geti2p.net/htproxyports target=_blank rel=noreferrer>the configuration guide</a>, or <a href=/help/configuration#browserconfig>the mini-tutorial for Firefox</a>.";
    t[4055] = "Za \u00fa\u010delem p\u0159\u00edstupu k webov\u00fdm str\u00e1nk\u00e1m hostovan\u00fdm v s\u00edti I2P a voliteln\u00fdm pou\u017eit\u00edm v\u00fdchoz\u00edho vystupuj\u00edc\u00edho proxy pro p\u0159ipojen\u00ed k webov\u00fdm str\u00e1nk\u00e1m na clearnetu, je nutn\u00e9 nakonfigurovat v\u00e1\u0161 prohl\u00ed\u017ee\u010d k pou\u017eit\u00ed I2P+ <b>HTTP</b> proxy, kter\u00e1 standardn\u011b b\u011b\u017e\u00ed na <code>127.0.0.1 port 4444</code>. Pro v\u00edce informac\u00ed nav\u0161tivte <a href=https://geti2p.net/htproxyports target=_blank rel=noreferrer>pr\u016fvodce konfigurac\u00ed</a> nebo <a href=/help/configuration#browserconfig>n\u00e1vod pro Firefox</a>.";
