    t[4332] = "Note: The order of the declarations matters. The first threshold declaration for a given destination (whether explicit or listed in a referenced file) overrides any future thresholds for the same destination, whether explicit or listed in a file. Note: to apply a new filter file, the tunnel must be restarted after the location has been specified in the tunnel manager. Once configured, a definition file can be updated without requiring a restart of the target tunnel, although destinations that are blocked will persist until the tunnel is restarted.";
    t[4333] = "Pozn\u00e1mka: Po\u0159ad\u00ed prohl\u00e1\u0161en\u00ed je d\u016fle\u017eit\u00e9. Prvn\u00ed prohl\u00e1\u0161en\u00ed prahu pro dan\u00fd c\u00edl (bu\u010f explicitn\u00ed nebo uveden\u00e9 v odkazovan\u00e9m souboru) p\u0159ep\u00ed\u0161e jak\u00e9koli budouc\u00ed prahy pro stejn\u00fd c\u00edl, a\u0165 u\u017e jsou explicitn\u00ed nebo uveden\u00e9 v souboru. Pozn\u00e1mka: Pro uplatn\u011bn\u00ed nov\u00e9ho souboru filtr\u016f mus\u00ed b\u00fdt tunel znovu spu\u0161t\u011bn pot\u00e9, co bylo um\u00edst\u011bn\u00ed ur\u010deno spr\u00e1vcem tunel\u016f. Jakmile je konfigurace dokon\u010dena, lze soubor s definic\u00ed aktualizovat bez nutnosti restartu c\u00edlov\u00e9ho tunelu, i kdy\u017e c\u00edle, kter\u00e9 jsou blokov\u00e1ny, z\u016fstanou zachov\u00e1ny, dokud tunel nebude znovu spu\u0161t\u011bn.";
