    t[4624] = "<b>Note:</b> On some Apache installations, the <a href=https://httpd.apache.org/docs/2.4/mod/mod_status.html target=_blank class='sitelink external'>mod_status</a> and <a href=https://httpd.apache.org/docs/2.4/mod/mod_info.html target=_blank class='sitelink external'>mod_info</a> modules are enabled by default. It is important to disable these, or otherwise protect access to the urls, to avoid compromising the anonymity and security of your server.";
    t[4625] = "<b>Pozn\u00e1mka:</b> Na n\u011bkter\u00fdch instalac\u00edch Apache jsou moduly <a href=https://httpd.apache.org/docs/2.4/mod/mod_status.html target=_blank class='sitelink external'>mod_status</a> a <a href=https://httpd.apache.org/docs/2.4/mod/mod_info.html target=_blank class='sitelink external'>mod_info</a> v\u00fdchoz\u00edm nastaven\u00edm povolen\u00e9. Je d\u016fle\u017eit\u00e9 tyto moduly zak\u00e1zat, nebo jinak zabezpe\u010dit p\u0159\u00edstup k adres\u00e1m URL, abyste zabr\u00e1nili ohro\u017een\u00ed anonymity a zabezpe\u010den\u00ed va\u0161eho serveru.";
