    t[4670] = "The version of the I2P software you are running. If a new version is available, you will be notified in the Sidebar. It is recommended to keep your router up to date to ensure optimal performance and security. Router updates are usually made available on average every 2-3 months.";
    t[4671] = "Verze I2P softwaru, kterou pou\u017e\u00edv\u00e1te. Pokud je k dispozici nov\u00e1 verze, budete o tom informov\u00e1ni v postrann\u00edm panelu. Doporu\u010duje se udr\u017eovat aktualizovan\u00fd sm\u011brova\u010d pro zaji\u0161t\u011bn\u00ed optim\u00e1ln\u00edho v\u00fdkonu a zabezpe\u010den\u00ed. Aktualizace sm\u011brova\u010de jsou obvykle dostupn\u00e9 pr\u016fm\u011brn\u011b ka\u017ed\u00e9 2-3 m\u011bs\u00edce.";
