    t[4697] = "Preferujte IPv4 p\u0159ed IPv6";
    t[4702] = "NTCP (NIO-based TCP) and NTCP2 are TCP-based network transports which use Java's NIO (New I/O) TCP implementation to deliver I2NP messages between routers on the network. NTCP2 improves the resistance of NTCP to various attacks and automated traffic identification methods. For more information, see the <a href=https://geti2p.net/en/docs/transport/ntcp class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[4703] = "NTCP (TCP zalo\u017een\u00fd na NIO) a NTCP2 jsou transporty s\u00edt\u011b zalo\u017een\u00e9 na TCP, kter\u00e9 pou\u017e\u00edvaj\u00ed implementaci TCP se Javaho NIO (New I/O) k doru\u010dov\u00e1n\u00ed zpr\u00e1v I2NP mezi sm\u011brova\u010di v s\u00edti. NTCP2 zvy\u0161uje odolnost NTCP v\u016f\u010di r\u016fzn\u00fdm \u00fatok\u016fm a automatizovan\u00fdm metod\u00e1m identifikace provozu. Dal\u0161\u00ed informace naleznete v <a href=https://geti2p.net/en/docs/transport/ntcp class='sitelink external' target=_blank rel=noreferrer>online dokumentaci</a>.";
    t[4708] = "You can use a recorder to log the destinations of aggressive clients to a specified file, and then use that same file to throttle them. The following snippet defines a filter that initially allows all connection requests, but if any single destination exceeds 180 requests in 60 seconds, it gets throttled down to 30 requests every 60 seconds:";
    t[4709] = "Z\u00e1znam lze pou\u017e\u00edt k zaznamen\u00e1v\u00e1n\u00ed c\u00edl\u016f agresivn\u00edch klient\u016f do specifikovan\u00e9ho souboru a pak tento stejn\u00fd soubor pou\u017e\u00edt k jejich omezen\u00ed. N\u00e1sleduj\u00edc\u00ed uk\u00e1zka definuje filtr, kter\u00fd p\u016fvodn\u011b umo\u017en\u00ed v\u0161echny po\u017eadavky na p\u0159ipojen\u00ed, ale pokud jak\u00fdkoli jednotliv\u00fd c\u00edl v p\u0159\u00ed\u0161t\u00edch 60 sekund\u00e1ch p\u0159ekro\u010d\u00ed 180 po\u017eadavk\u016f, bude omezen na 30 po\u017eadavk\u016f ka\u017ed\u00fdch 60 sekund:";
