    t[5042] = "When set to true, this setting enables reverse DNS lookups for peers, triggered when displaying the country flag of a peer or when the hostname or domain is explicitly displayed in the console, or when the peer's RouterInfo is written to disk. In order to avoid repeat lookups, it's recommended to configure a generous caching policy for DNS lookups of 10 minutes or more, and to configure a privacy respecting DNS server in your operating system. [Disabled by default, restart required]";
    t[5043] = "Kdy\u017e je nastaveno na true, tato volba umo\u017e\u0148uje zp\u011btn\u00e9 DNS vyhled\u00e1v\u00e1n\u00ed pro vrstevn\u00edky, kter\u00e9 je vyvol\u00e1no p\u0159i zobrazen\u00ed vlajky zem\u011b vrstevn\u00edka nebo kdy\u017e je hostname nebo dom\u00e9na explicitn\u011b zobrazena v konzoli, nebo kdy\u017e je RouterInfo vrstevn\u00edka zaps\u00e1n na disk. Aby se zabr\u00e1nilo opakovan\u00fdm vyhled\u00e1v\u00e1n\u00edm, doporu\u010duje se nastavit velkorysou politiku ke\u0161ov\u00e1n\u00ed DNS vyhled\u00e1v\u00e1n\u00ed na 10 minut nebo d\u00e9le a nastavit DNS server, kter\u00fd respektuje soukrom\u00ed, v opera\u010dn\u00edm syst\u00e9mu. [V\u00fdchoz\u00ed hodnota je vypnuta, je pot\u0159eba restartovat]";
