    t[5084] = "If you're running a dynamic site handling a large number of concurrent users, content caching can often improve the time taken to deliver pages. For content that rapidly changes, a <a href=https://blog.stackpath.com/glossary-micro-caching/ target=_blank class='sitelink external'>micro-caching strategy</a> may still yield some benefits. The <a href=https://www.nginx.com/ target=_blank class='sitelink external'>Nginx webserver</a> provides a competent caching sub-system, or for a more heavy-weight solution, have a look at <a href=https://varnish-cache.org/ target=_blank class='sitelink external'>Varnish</a>.";
    t[5085] = "Pokud provozujete dynamick\u00fd web zpracov\u00e1vaj\u00edc\u00ed velk\u00e9 mno\u017estv\u00ed soub\u011b\u017en\u00fdch u\u017eivatel\u016f, cache obsahu \u010dasto zlep\u0161uje dobu doru\u010den\u00ed str\u00e1nek. Pro obsah, kter\u00fd se rychle m\u011bn\u00ed, m\u016f\u017ee <a href=https://blog.stackpath.com/glossary-micro-caching/ target=_blank class='sitelink external'>strategie mikro-cache</a> st\u00e1le p\u0159in\u00e1\u0161et n\u011bkter\u00e9 v\u00fdhody. <a href=https://www.nginx.com/ target=_blank class='sitelink external'>Nginx webov\u00fd server</a> poskytuje kompetentn\u00ed pod-syst\u00e9m cache nebo, pokud hled\u00e1te t\u011b\u017e\u0161\u00ed \u0159e\u0161en\u00ed, pod\u00edvejte se na <a href=https://varnish-cache.org/ target=_blank class='sitelink external'>Varnish</a>.";
