    t[5514] = "If after a few minutes of uptime your router is indicating 0 Active Peers and 0 Known Peers, with a notification in the sidebar that you need to check your network connection, verify that you can access the internet. If your internet connection is functional, you may need to unblock Java in your firewall. Otherwise, you may need to reseed your I2P router. Visit the <a href=/configreseed#reseedconfig>Reseed Configuration page</a> and click the <i>Save Changes and Reseed Now</i> button. For more information, see the <a href=#reseedhelp>Reseed help section</a> above.";
    t[5515] = "Pokud po n\u011bkolika minut\u00e1ch aktivn\u00edho provozu v\u00e1\u0161 sm\u011brova\u010d zobrazuje hodnoty 0 aktivn\u00edch spojen\u00ed a 0 zn\u00e1m\u00fdch spojen\u00ed spolu s ozn\u00e1men\u00edm v postrann\u00edm panelu, \u017ee je nutn\u00e9 zkontrolovat p\u0159ipojen\u00ed k s\u00edti, ov\u011b\u0159te, zda je p\u0159\u00edstup na internet funk\u010dn\u00ed. Pokud je v\u00e1\u0161 internetov\u00fd p\u0159ipojen\u00ed v po\u0159\u00e1dku, je mo\u017en\u00e9, \u017ee je pot\u0159eba povolit Java ve va\u0161\u00ed firewallu. V opa\u010dn\u00e9m p\u0159\u00edpad\u011b je mo\u017en\u00e9, \u017ee je pot\u0159eba restartovat v\u00e1\u0161 I2P sm\u011brova\u010d. Nav\u0161tivte str\u00e1nku konfigurace p\u0159evnosu dat na <a href=/configreseed#reseedconfig>konfiguraci p\u0159eno\u00e1\u0161en\u00ed dat</a> a klikn\u011bte na tla\u010d\u00edtko <i>Ulo\u017eit zm\u011bny a p\u0159ev\u00e9st data nyn\u00ed</i>. Pro v\u00edce informac\u00ed se pod\u00edvejte na sekci n\u00e1pov\u011bdy k p\u0159evnosu dat v\u00fd\u0161e.";
    t[5518] = "A higher level socket API for clients. Only opened when a SAM V3 client requests a UDP session. Can be enabled/disabled on the <a href=/configclients> Client Configuration page</a>. Can be changed in the <code>clients.config</code> file with the SAM command line option <code>sam.udp.port=nnnn</code>.";
    t[5519] = "Vy\u0161\u0161\u00ed \u00farove\u0148 socketov\u00e9ho API pro klienty. Otev\u00edr\u00e1 se pouze tehdy, kdy\u017e klient SAM V3 po\u017e\u00e1d\u00e1 o UDP relaci. M\u016f\u017ee b\u00fdt povoleno/zak\u00e1z\u00e1no na str\u00e1nce <a href=/configclients>Konfigurace klienta</a>. M\u016f\u017ee b\u00fdt zm\u011bn\u011bno v souboru <code>clients.config</code> pomoc\u00ed p\u0159\u00edkazov\u00e9 \u0159\u00e1dky SAM s volbou <code>sam.udp.port=nnnn</code>.";
    t[5526] = "If you want your site to feel responsive, image compression is essential when hosting large images. Using a service like <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> to compress your png and jpeg images will often result in much smaller files with minimal loss of quality. In some situations the webp format can best jpegs, generating smaller files with approximately the same or better visual fidelity, and has wide browser support. Also consider using svgs instead of bitmaps for icons and illustrations - they're often smaller than the equivalent bitmap file (run them through a service like <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> to remove unneeded cruft), scale without loss of quality, and can be gzipped by your webserver.";
    t[5527] = "Pokud chcete, aby va\u0161e str\u00e1nky p\u016fsobily rychle, je p\u0159i hostov\u00e1n\u00ed velk\u00fdch obr\u00e1zk\u016f nezbytn\u00e1 komprese obr\u00e1zk\u016f. Pou\u017eit\u00ed slu\u017eby jako <a href=https://tinypng.com/ target=_blank class='sitelink external'>tinypng.com</a> pro kompresi png a jpeg obr\u00e1zk\u016f \u010dasto vede k mnohem men\u0161\u00edm soubor\u016fm s minim\u00e1ln\u00ed ztr\u00e1tou kvality. V n\u011bkter\u00fdch situac\u00edch m\u016f\u017ee webp form\u00e1t p\u0159ekonat jpeg, generovat men\u0161\u00ed soubory s p\u0159ibli\u017en\u011b stejnou nebo lep\u0161\u00ed vizu\u00e1ln\u00ed v\u011brnost\u00ed a \u0161irokou podporou prohl\u00ed\u017ee\u010d\u016f. Zva\u017ete tak\u00e9 pou\u017eit\u00ed svg m\u00edsto bitov\u00fdch map pro ikony a ilustrace - jsou \u010dasto men\u0161\u00ed ne\u017e ekvivalentn\u00ed soubor bitmapov\u00fdch obr\u00e1zk\u016f (spus\u0165te je p\u0159es slu\u017ebu jako <a href=https://vecta.io/nano target=_blank class='sitelink external'>Nano SVG Optimizer</a> pro odstran\u011bn\u00ed nepot\u0159ebn\u00e9ho balastu), zachov\u00e1vaj\u00ed \u0161k\u00e1lovatelnost bez ztr\u00e1ty kvality a mohou b\u00fdt gzipov\u00e1ny na webserveru.";
