    t[5712] = "Firewalled with Inbound TCP Enabled";
    t[5713] = "Firewalled s povolen\u00fdm p\u0159\u00edchoz\u00edm TCP";
    t[5716] = "Open <a href=/confignet#udpconfig>I2P+'s port</a> on your modem, router and/or firewall(s) for better connectivity (ideally both UDP and TCP). More information on how to go about port forwarding can be found at <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>, in addition to our forums and IRC channels listed below. Note that I2P does not support connecting to the internet via an http or socks proxy [patches welcome!], though you can connect to proxies via I2P itself once connected to the network.";
    t[5717] = "Otev\u0159ete port <a href=/confignet#udpconfig>I2P+</a> na sv\u00e9m modemu, routeru a/nebo firewallu(\u00e1ch) pro lep\u0161\u00ed konektivitu (ide\u00e1ln\u011b jak UDP, tak TCP). Dal\u0161\u00ed informace o nastaven\u00ed p\u0159esm\u011brov\u00e1n\u00ed port\u016f naleznete na str\u00e1nce <a href=http://portforward.com/ target=_blank rel=noreferrer class='sitelink external'>portforward.com</a>, stejn\u011b jako na na\u0161ich f\u00f3rech a IRC kan\u00e1lech uveden\u00fdch n\u00ed\u017ee. Upozor\u0148ujeme, \u017ee I2P nepodporuje p\u0159ipojen\u00ed k internetu pomoc\u00ed HTTP nebo SOCKS proxy [patches welcome!], ale m\u016f\u017eete se p\u0159ipojit k proxy p\u0159es I2P samotn\u00e9, jakmile jste p\u0159ipojeni k s\u00edti.";
    t[5730] = "A tunnel filter can provide protection against denial of service attacks, without otherwise interrupting the service for genuine users, either in conjunction with the tunnel throttler or as an alternative strategy. It can also be used to log access to a hosted service to determine if the server is under attack, or simply to log all visitors by I2P destination. Additionally, a filter can function simultaneously as a whitelist and blacklist making it more flexible than the Tunnel Manager's access list controls. Note that multiple server tunnels can share a single filter file if you wish to implement a global filter.";
    t[5731] = "Filtr tunelu m\u016f\u017ee poskytnout ochranu p\u0159ed odm\u00edtnut\u00edm slu\u017eby bez naru\u0161en\u00ed slu\u017eby pro opravdov\u00e9 u\u017eivatele, bu\u010f s omezova\u010dem tunel\u016f nebo jako alternativn\u00ed strategie. M\u016f\u017ee tak\u00e9 slou\u017eit k z\u00e1znamu p\u0159\u00edstupu do hostovan\u00e9 slu\u017eby k zji\u0161t\u011bn\u00ed, zda je server pod \u00fatokem, nebo jednodu\u0161e k zaznamen\u00e1v\u00e1n\u00ed v\u0161ech n\u00e1v\u0161t\u011bvn\u00edk\u016f podle I2P c\u00edle. Filtr m\u016f\u017ee fungovat sou\u010dasn\u011b jako seznam povolen\u00fdch a blokovan\u00fdch polo\u017eek, co\u017e jej \u010din\u00ed flexibiln\u011bj\u0161\u00edm ne\u017e ovl\u00e1dac\u00ed prvky seznamu p\u0159\u00edstupu Spr\u00e1vce tunel\u016f. Uv\u011bdomte si, \u017ee v\u00edce serverov\u00fdch tunel\u016f m\u016f\u017ee sd\u00edlet jedin\u00fd soubor filtru, pokud si p\u0159ejete implementovat glob\u00e1ln\u00ed filtr.";
