    t[6026] = "This setting (in milliseconds) allows you to manually configure the delay between router refresh updates run by the Refresh Routers Job. By default the pause between refreshes is determined by the size of the NetDb, and introduces some randomness in the timing to mitigate traffic analysis. For values lower than 2000 milliseconds, increasing the value of <code>router.refreshTimeout</code> is recommended. Note that setting this value below 2000 milliseconds will increase your network traffic and may introduce job lag, and is not recommended for sustained use.";
    t[6027] = "Toto nastaven\u00ed (v milisekund\u00e1ch) v\u00e1m umo\u017e\u0148uje manu\u00e1ln\u011b konfigurovat prodlevu mezi aktualizacemi router\u016f prov\u00e1d\u011bn\u00fdmi Refresh Routers Job. Ve v\u00fdchoz\u00edm nastaven\u00ed je prodleva mezi aktualizacemi ur\u010dena velikost\u00ed NetDb a zav\u00e1d\u00ed ur\u010ditou n\u00e1hodnost v \u010dasov\u00e1n\u00ed, aby se minimalizovala anal\u00fdza provozu. Pro hodnoty ni\u017e\u0161\u00ed ne\u017e 2000 milisekund se doporu\u010duje zv\u00fd\u0161en\u00ed hodnoty <code>router.refreshTimeout</code>. Upozor\u0148ujeme, \u017ee nastaven\u00ed t\u00e9to hodnoty pod 2000 milisekund zv\u00fd\u0161\u00ed v\u00e1\u0161 s\u00ed\u0165ov\u00fd provoz a m\u016f\u017ee zp\u016fsobit zpo\u017ed\u011bn\u00ed \u00faloh, proto se nedoporu\u010duje pro trval\u00e9 pou\u017eit\u00ed.";
    t[6030] = "Server tunnels, configurable in the <a href=/i2ptunnelmgr>Tunnel Manager</a>, provide a number of ways to limit access to the hosted service. Destination whitelisting, blacklisting, connection throttling, and tunnel filtering are methods provisioned to mitigate denial of service attacks, grant exclusive access to known I2P destinations, and manage traffic to the server.";
    t[6031] = "Serverov\u00e9 tunely, kter\u00e9 lze konfigurovat v <a href=/i2ptunnelmgr>Spr\u00e1vci tunel\u016f</a>, poskytuj\u00ed n\u011bkolik zp\u016fsob\u016f, jak omezit p\u0159\u00edstup k hostovan\u00e9 slu\u017eb\u011b. Metody, jako je vyb\u00edr\u00e1n\u00ed povolen\u00e9ho a blokovan\u00e9ho c\u00edle, omezov\u00e1n\u00ed spojen\u00ed a filtrov\u00e1n\u00ed tunel\u016f jsou p\u0159ipraveny k minimalizaci odm\u00edtnut\u00ed slu\u017eby, poskytov\u00e1n\u00ed exkluzivn\u00edho p\u0159\u00edstupu k zn\u00e1m\u00fdm I2P destinac\u00edm a \u0159\u00edzen\u00ed provozu na serveru.";
