    t[6350] = "This setting determines the number of peers to explore in parallel when the Peer Exploration Job runs [default is 1 peer at a time when more than 3000 peers are known]. Note that increasing this value will increase the bandwidth requirements for the exploration, and setting this value too high may cause excessive message delay and interfere with other services, so use with caution!";
    t[6351] = "Toto nastaven\u00ed ur\u010duje po\u010det uzl\u016f k pr\u016fzkumu paraleln\u011b, kdy\u017e je spu\u0161t\u011bna \u00faloha prozkoum\u00e1v\u00e1n\u00ed uzl\u016f [v\u00fdchoz\u00ed hodnota je 1 uzel najednou, kdy\u017e je zn\u00e1mo v\u00edce ne\u017e 3000 uzl\u016f]. Upozor\u0148ujeme, \u017ee zv\u00fd\u0161en\u00ed t\u00e9to hodnoty zv\u00fd\u0161\u00ed po\u017eadavky na \u0161\u00ed\u0159ku p\u00e1sma pro pr\u016fzkum, a nastaven\u00ed t\u00e9to hodnoty p\u0159\u00edli\u0161 vysoko m\u016f\u017ee zp\u016fsobit nadm\u011brn\u00e9 zpo\u017ed\u011bn\u00ed zpr\u00e1v a p\u0159ek\u00e1\u017eet jin\u00fdm slu\u017eb\u00e1m, pou\u017e\u00edvejte proto s opatrnost\u00ed!";
