    t[6382] = "Note: To enhance your security when browsing .i2p sites, you may wish to consider installing an addon to prevent Javascript from running in the browser such as <a href=https://addons.mozilla.org/en-US/firefox/addon/noscript/ target=_blank rel=noreferrer class='sitelink external'>NoScript</a>, though it's recommended to whitelist the address I2P+ is running on to enable various router console enhancements. In addition, an addon that prevents requests to offsite resources is also recommended, for example <a href=https://addons.mozilla.org/en-US/firefox/addon/umatrix/ target=_blank rel=noreferrer class='sitelink external'>uMatrix</a>.";
    t[6383] = "Pozn\u00e1mka: Pro zv\u00fd\u0161en\u00ed zabezpe\u010den\u00ed p\u0159i prohl\u00ed\u017een\u00ed str\u00e1nek .i2p m\u016f\u017eete zv\u00e1\u017eit instalaci roz\u0161\u00ed\u0159en\u00ed, kter\u00e9 zabr\u00e1n\u00ed spu\u0161t\u011bn\u00ed JavaScriptu v prohl\u00ed\u017ee\u010di, nap\u0159\u00edklad <a href=https://addons.mozilla.org/en-US/firefox/addon/noscript/ target=_blank rel=noreferrer class='sitelink external'>NoScript</a>. Doporu\u010duje se v\u0161ak p\u0159idat adresu, na kter\u00e9 b\u011b\u017e\u00ed I2P+, na seznam povolen\u00fdch, aby bylo mo\u017en\u00e9 vyu\u017e\u00edvat r\u016fzn\u00fdch vylep\u0161en\u00ed konzole sm\u011brova\u010de. K dispozici je tak\u00e9 roz\u0161\u00ed\u0159en\u00ed, kter\u00e9 br\u00e1n\u00ed \u017e\u00e1dostem o extern\u00ed zdroje, nap\u0159\u00edklad <a href=https://addons.mozilla.org/en-US/firefox/addon/umatrix/ target=_blank rel=noreferrer class='sitelink external'>uMatrix</a>.";
