    t[6944] = "A java implementation of a Tor client, available as an I2P plugin. Can be used as the default <i>outproxy</i> if configured in the relevant SOCKS or HTTP client tunnel in the <i>Tunnel Manager</i>. Available from <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. Source code is available on <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>github</a>.";
    t[6945] = "Java verze klienta Toru dostupn\u00e1 jako plugin pro I2P. M\u016f\u017ee b\u00fdt pou\u017eita jako v\u00fdchoz\u00ed <i>outproxy</i> pokud je nakonfigurov\u00e1na ve spr\u00e1vn\u00e9m SOCKS nebo HTTP klient tunelu v <i>Tunnel Manager</i>. Dostupn\u00e9 z <a href=http://stats.i2p/i2p/plugins class=sitelink>http://stats.i2p/i2p/plugins</a>. Zdrojov\u00fd k\u00f3d je dostupn\u00fd na <a href=https://github.com/i2p/i2p.plugins.orchid class='sitelink external' target=_blank rel=noreferrer>GitHub</a>.";
    t[6952] = "IPv4 Addresses";
    t[6953] = "Adresy IPv4";
    t[6956] = "This section indicates your average bandwidth speeds and total usage for the session. All values are in bytes per second. You may change your bandwidth limits on the <a href='/config'>Bandwidth Configuration page</a>. The more bandwidth you make available, the more you help the network and improve your own anonymity, so please take the time to review the settings. If you are unsure of your network's speed, using a service such as <a href='http://speedtest.net/'>SpeedTest</a> or similar will give you a good indication of your bandwidth capability. Your upstream share amount (KBps Out) will determine your overall contribution to the network. Bandwidth is <a href='/graphs'>graphed</a> by default.";
    t[6957] = "Tato sekce ukazuje pr\u016fm\u011brnou rychlost p\u0159enosu a celkov\u00e9 vyu\u017eit\u00ed va\u0161eho p\u00e1sma pro tuto relaci. V\u0161echny hodnoty jsou uvedeny v bytech za sekundu. \u00dapravu limit\u016f p\u0159enosov\u00e9 rychlosti m\u016f\u017eete prov\u00e9st na <a href='/config'>str\u00e1nce konfigurace p\u0159enosov\u00e9 rychlosti</a>. \u010c\u00edm v\u00edce p\u0159enosov\u00e9ho p\u00e1sma d\u00e1te k dispozici, t\u00edm v\u00edce pom\u00e1h\u00e1te s\u00edti a zvy\u0161ujete vlastn\u00ed anonymitu, proto si pros\u00edm vezm\u011bte \u010das na p\u0159ezkoum\u00e1n\u00ed nastaven\u00ed. Pokud nejste jisti rychlost\u00ed va\u0161\u00ed s\u00edt\u011b, pou\u017eit\u00ed slu\u017eby jako je <a href='http://speedtest.net/'>SpeedTest</a> nebo podobn\u00e1 v\u00e1m poskytne dobrou p\u0159edstavu o kapacit\u011b va\u0161eho p\u0159enosov\u00e9ho p\u00e1sma. Va\u0161e mno\u017estv\u00ed sd\u00edlen\u00e9 v\u00fdchoz\u00ed p\u0159enosov\u00e9 rychlosti (KBps Out) bude ur\u010dovat v\u00e1\u0161 celkov\u00fd p\u0159\u00edsp\u011bvek do s\u00edt\u011b. P\u0159enosov\u00e1 rychlost se ve v\u00fdchoz\u00edm nastaven\u00ed <a href='/graphs'>zobrazuje graficky</a>.";
