    t[7004] = "This setting allows you to configure the minimum number of hosted participating tunnels before the router starts to reject tunnel requests based on anticipated bandwidth requirements. [Default is 100 if system is running Android, 800 if system is running on ARM and less than 4 cores available, 1200 if system is running on ARM and 4 or more cores available, otherwise 2500]";
    t[7005] = "Toto nastaven\u00ed v\u00e1m umo\u017e\u0148uje nakonfigurovat minim\u00e1ln\u00ed po\u010det hostovan\u00fdch participativn\u00edch tunel\u016f, ne\u017e sm\u011brova\u010d za\u010dne odm\u00edtat \u017e\u00e1dosti o tunel na z\u00e1klad\u011b p\u0159edpokl\u00e1dan\u00fdch po\u017eadavk\u016f na p\u0159enosovou rychlost. [V\u00fdchoz\u00ed hodnota je 100, pokud syst\u00e9m b\u011b\u017e\u00ed na Androidu, 800, pokud syst\u00e9m b\u011b\u017e\u00ed na ARM a je k dispozici m\u00e9n\u011b ne\u017e 4 j\u00e1dra, 1200, pokud syst\u00e9m b\u011b\u017e\u00ed na ARM a k dispozici je 4 nebo v\u00edce jader, jinak 2500]";
