    t[7195] = "Nenastavili jste p\u0159\u00edchoz\u00ed TCP s hostitelem a portem na str\u00e1nce s konfigurac\u00ed s\u00edt\u011b, ale vypnuli jste UDP.";
    t[7200] = "Certificates are used to authenticate encrypted services running on the network, provision optional SSL for hosted services and the router console, or provide proof of ownership of a router family.";
    t[7201] = "Certifik\u00e1ty se pou\u017e\u00edvaj\u00ed k ov\u011b\u0159ov\u00e1n\u00ed \u0161ifrovan\u00fdch slu\u017eeb spu\u0161t\u011bn\u00fdch v s\u00edti, poskytov\u00e1n\u00ed voliteln\u00e9ho SSL pro hostovan\u00e9 slu\u017eby a konzoli sm\u011brova\u010de nebo k poskytnut\u00ed d\u016fkazu o vlastnictv\u00ed rodiny sm\u011brova\u010d\u016f.";
