    t[7284] = "The data gathered is quantized over a 1 minute period, so should just be used as an estimate.";
    t[7285] = "Shrom\u00e1\u017ed\u011bn\u00e1 data jsou kvantov\u00e1na po dobu 1 minuty, tak\u017ee by m\u011bla b\u00fdt pou\u017eita pouze jako odhad.";
    t[7292] = "When set to true, I2P runs without network connectivity, which is helpful if you are constantly restarting the router to test code updates as this prevents network disruption.";
    t[7293] = "Pokud je nastaveno na true, I2P b\u011b\u017e\u00ed bez s\u00ed\u0165ov\u00e9 konektivity, co\u017e je u\u017eite\u010dn\u00e9, pokud neust\u00e1le restartujete sm\u011brova\u010d, abyste otestovali aktualizace k\u00f3du, proto\u017ee to zabr\u00e1n\u00ed p\u0159eru\u0161en\u00ed s\u00edt\u011b.";
    t[7302] = "Updating IP address";
    t[7303] = "Aktualizace IP adresy";
    t[7308] = "SSU [IPv6 Only] with Introducers";
    t[7309] = "Pouze IPv6 SSU, zavad\u011b\u010di";
    t[7312] = "SSU (Secure Semi-reliable UDP) is an I2P network transport providing encrypted, connection-oriented, point-to-point connections, in addition to IP address detection and NAT traversal services. For more information, see the <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>online documentation</a>.";
    t[7313] = "SSU (Secure Semi-reliable UDP) je doprava I2P s\u00edt\u011b poskytuj\u00edc\u00ed \u0161ifrovan\u00e9, orientovan\u00e9 na spojen\u00ed, bodov\u00e9 p\u0159ipojen\u00ed, krom\u011b toho tak\u00e9 detekci IP adresy a slu\u017eby NAT traversal. Dal\u0161\u00ed informace naleznete v <a href=https://geti2p.net/en/docs/transport/ssu class='sitelink external' target=_blank rel=noreferrer>online dokumentaci</a>.";
    t[7314] = "Congestion window";
    t[7315] = "Okno p\u0159et\u00ed\u017een\u00ed";
    t[7326] = "Use Proxy to Reseed";
    t[7327] = "K op\u011btovn\u00e9mu na\u010dten\u00ed pou\u017eijte proxy";
    t[7328] = "Until the advent of I2P integration in <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a>, it wasn't possible to download torrents that weren't hosted on the I2P network. However, now that Vuze (and latterly <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) allow users to share non-I2P torrents on I2P, non-I2P torrents can be downloaded over I2P if Vuze/Bigly users have chosen to make content available to the I2P network. Popular torrents with a large number of peers are more likely to be accessible via I2P; to determine if the content is available, add the torrent link, magnet or infohash to your I2P-enabled BitTorrent client.";
    t[7329] = "Do p\u0159\u00edchodu integrace I2P do <a href=http://www.vuze.com/ target=_blank rel=noreferrer class='sitelink external'>Vuze</a> nebylo mo\u017en\u00e9 stahovat torrenty, kter\u00e9 nebyly hostov\u00e1ny na s\u00edti I2P. Nyn\u00ed v\u0161ak u\u017e u\u017eivatel\u00e9 program\u016f Vuze (a nov\u011bji <a href=https://www.biglybt.com/ target=_blank rel=noreferrer class='sitelink external'>Bigly</a>) mohou sd\u00edlet nesouvisej\u00edc\u00ed torrenty na I2P, a tak mohou b\u00fdt nesouvisej\u00edc\u00ed torrenty stahov\u00e1ny p\u0159es I2P, pokud u\u017eivatel\u00e9 Vuze/Bigly se rozhodnou ud\u011blat obsah dostupn\u00fdm pro I2P s\u00ed\u0165. Popul\u00e1rn\u00ed torrenty s velk\u00fdm po\u010dtem vrstev jsou pravd\u011bpodobn\u011bj\u0161\u00ed, \u017ee budou p\u0159\u00edstupn\u00e9 p\u0159es I2P; abyste zjistili, zda je obsah dostupn\u00fd, p\u0159idejte odkaz na torrent, magnet nebo infohash do sv\u00e9ho BitTorrent klienta s povolenou podporou I2P.";
