    t[7428] = "This setting (in hours) determines how old a RouterInfo in the NetDb is (its last known publication date) before it's classified as stale and deleted. [Default is 28 hours unless the router is a Floodfill, in which case the default is 8 hours]";
    t[7429] = "Toto nastaven\u00ed (v hodin\u00e1ch) ur\u010duje, jak star\u00e1 je RouterInfo v NetDb (jeho posledn\u00ed zn\u00e1m\u00e9 datum publikace) p\u0159ed t\u00edm, ne\u017e bude ozna\u010dena jako zastaral\u00e1 a smaz\u00e1na. [V\u00fdchoz\u00ed hodnota je 28 hodin, pokud nen\u00ed smy\u010dkov\u00fd sm\u011brova\u010d, v takov\u00e9m p\u0159\u00edpad\u011b je v\u00fdchoz\u00ed hodnota 8 hodin]";
