    t[8208] = "Wherever possible, assets that are used repeatedly on your site should be loaded from an external file and not inlined. If you're using the same CSS on several pages, create a separate css file and load that in the <code>&lt;head&gt;</code> section of your pages. This will make styling updates to your site easier to manage, and will also allow the file to be cached in the visitor's browser, resulting in less bandwidth demands on your webserver and faster page loads for your visitors.";
    t[8209] = "Pokud je to mo\u017en\u00e9, m\u011bly by se opakovan\u011b pou\u017e\u00edvan\u00e9 prost\u0159edky na va\u0161em webu na\u010d\u00edst z extern\u00edho souboru a ne b\u00fdt vlo\u017eeny. Pokud pou\u017e\u00edv\u00e1te stejn\u00fd CSS na n\u011bkolika str\u00e1nk\u00e1ch, vytvo\u0159te zvl\u00e1\u0161tn\u00ed css soubor a na\u010dt\u011bte jej v sekci <code>&lt;head&gt;</code> na va\u0161ich str\u00e1nk\u00e1ch. To usnadn\u00ed spr\u00e1vu aktualizac\u00ed stylov\u00e1n\u00ed va\u0161eho webu a umo\u017en\u00ed soubor ulo\u017eit v mezipam\u011bti n\u00e1v\u0161t\u011bvn\u00edka prohl\u00ed\u017ee\u010de, co\u017e sn\u00ed\u017e\u00ed po\u017eadavky na \u0161\u00ed\u0159ku p\u00e1sma na va\u0161em webov\u00e9m serveru a zrychl\u00ed na\u010d\u00edt\u00e1n\u00ed str\u00e1nek pro va\u0161e n\u00e1v\u0161t\u011bvn\u00edky.";
