    t[8258] = "If you think you have opened up your firewall and I2P still thinks you are firewalled, remember that you may have multiple firewalls, for example both software packages and external hardware routers.";
    t[8259] = "Pokud si mysl\u00edte, \u017ee jste otev\u0159eli svou firewall a I2P st\u00e1le si mysl\u00ed, \u017ee jste firewalled, pamatujte si, \u017ee m\u016f\u017eete m\u00edt n\u011bkolik firewall\u016f, nap\u0159\u00edklad jak softwarov\u00fdch bal\u00ed\u010dk\u016f, tak extern\u00edch hardwarov\u00fdch router\u016f.";
