    t[8296] = "This is the number of peers your router will use for network database inquiries. These are usually the <i>floodfill</i> routers which are responsible for maintaining network integrity. Your well integrated peers are shown on the bottom of the <a href='/profiles'>Profiles page</a>.";
    t[8297] = "Toto je po\u010det peer\u016f, kter\u00e9 v\u00e1\u0161 sm\u011brova\u010d pou\u017e\u00edv\u00e1 pro odvol\u00e1vky s\u00edt\u011b v datab\u00e1zi. Obvykle se jedn\u00e1 o sm\u011brova\u010de <i>floodfill</i>, kter\u00e9 jsou zodpov\u011bdn\u00e9 za udr\u017eov\u00e1n\u00ed integrity s\u00edt\u011b. Va\u0161i dob\u0159e integrovan\u00ed peeri jsou zobrazeni na spode str\u00e1nky <a href='/profiles'>Profiles</a>.";
    t[8298] = "Manage Router webapps";
    t[8299] = "Spr\u00e1va webov\u00fdch aplikac\u00ed sm\u011brova\u010de";
    t[8302] = "Outbound TCP from random high ports to arbitrary remote TCP ports.";
    t[8303] = "V\u00fdstupn\u00ed TCP z n\u00e1hodn\u00fdch v\u00fd\u0161\u0161\u00edch port\u016f do libovoln\u00fdch vzd\u00e1len\u00fdch TCP port\u016f.";
    t[8310] = "When you start I2P, it may take a few minutes to bootstrap (integrate) your router into the network and find additional peers, so please be patient.";
    t[8311] = "Kdy\u017e spust\u00edte I2P, m\u016f\u017ee zav\u00e1d\u011bn\u00ed (integrace) va\u0161eho routeru do s\u00edt\u011b a nalezen\u00ed dal\u0161\u00edch koleg\u016f trvat n\u011bkolik minut, tak\u017ee bu\u010fte trp\u011bliv\u00ed.";
    t[8318] = "No file specified. Please select a valid .zip or .su3 file to reseed from.";
