    t[8323] = "Str\u00e1nka Nezn\u00e1m\u00fd pr\u016fvodce";
    t[8326] = "NTCP &amp; SSU with Introducers [IPv6 Only]";
    t[8327] = "IPv6 Pouze NTCP, SSU, zavad\u011b\u010de";
    t[8332] = "Messages sent to peer";
    t[8333] = "Zpr\u00e1vy odeslan\u00e9 peerovi";
    t[8334] = "Function";
    t[8335] = "Funkce";
    t[8336] = "On the I2P network, remotely hosted services can be accessed using a <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> address ending in \".b32.i2p\", a <i>destination</i> represented as a long <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a> string, or more usually by using an .i2p domain. A destination is I2P's equivalent to an IP address, and is shown on the <a href='/i2ptunnel/edit?tunnel=3'>Tunnel Manager Configuration page</a>. You can share your b32.i2p address to allow others to access to your website until you've registered your own .i2p domain.";
    t[8337] = "Na s\u00edti I2P je mo\u017en\u00e9 p\u0159istupovat k slu\u017eb\u00e1m hostovan\u00fdm na d\u00e1lku pomoc\u00ed adresy <a href=https://en.wikipedia.org/wiki/Base32 target=_blank rel=noreferrer class='sitelink external'>Base32</a> kon\u010d\u00edc\u00ed na \".b32.i2p\", p\u0159edstavuj\u00edc\u00ed <i>c\u00edl</i> p\u0159edstavovan\u00fd dlouh\u00fdm \u0159et\u011bzcem <a href=https://en.wikipedia.org/wiki/Base64 class='sitelink external'>Base64</a>, nebo ho \u010dast\u011bji pomoc\u00ed dom\u00e9ny .i2p. C\u00edl je ekvivalentem IP adresy a je zobrazen na str\u00e1nce <a href='/i2ptunnel/edit?tunnel=3'>Konfigurace Tunelu</a> Spr\u00e1vce tunel\u016f. M\u016f\u017eete sd\u00edlet svoji adresu b32.i2p, aby ostatn\u00ed mohli p\u0159istupovat k va\u0161emu webu, dokud si nep\u0159ihl\u00e1s\u00edte svoji vlastn\u00ed dom\u00e9nu .i2p.";
