    t[8466] = "Can be disabled in the <code>clients.config</code> file. Can also be configured to bind to a specific interface or all interfaces. If you make the Router Console available over the network, you might wish to <a href=/configui#passwordheading>enforce an access password</a> to prevent unauthorized access.";
    t[8467] = "M\u016f\u017ee b\u00fdt zak\u00e1z\u00e1no v souboru <code>clients.config</code>. M\u016f\u017ee b\u00fdt tak\u00e9 konfigurov\u00e1no k p\u0159ipojen\u00ed k ur\u010dit\u00e9mu rozhran\u00ed nebo ke v\u0161em rozhran\u00edm. Pokud zp\u0159\u00edstupn\u00edte routerovou konzoli po s\u00edti, mohlo by se v\u00e1m hodit <a href=/configui#passwordheading>povolen\u00ed p\u0159\u00edstupu heslem</a> pro zabr\u00e1n\u011bn\u00ed neopr\u00e1vn\u011bn\u00e9ho p\u0159\u00edstupu.";
