    t[8554] = "If you're not using IE, it's likely that your browser is pretending to be IE; please configure your browser (or proxy) to use a different User Agent string if you'd like to access the console themes.";
    t[8555] = "Pokud nepou\u017e\u00edv\u00e1te IE, je pravd\u011bpodobn\u00e9, \u017ee v\u00e1\u0161 prohl\u00ed\u017ee\u010d se vyd\u00e1v\u00e1 za IE. Nastavte si pros\u00edm prohl\u00ed\u017ee\u010d (nebo proxy) tak, aby pou\u017e\u00edval jin\u00fd \u0159et\u011bzec User-Agent, pokud chcete p\u0159istupovat k t\u00e9mat\u016fm konzole.";
    t[8564] = "Privacy-focused Clearnet Search Engine";
    t[8565] = "Vyhled\u00e1va\u010d Clearnet zam\u011b\u0159en\u00fd na soukrom\u00ed";
    t[8572] = "<a href=/logs>Logs</a> may help resolve a problem. You may wish to paste excerpts in a <a href=http://i2pforum.i2p/ target=_blank rel=noreferrer>forum</a> for help, or perhaps <a href=http://cake.i2p/pastebin/ target=_blank rel=noreferrer class='sitelink external'>paste</a> it instead and reference the link on IRC for help.";
    t[8573] = "<a href=/logs>Z\u00e1znamy</a> mohou pomoci vy\u0159e\u0161it probl\u00e9m. M\u016f\u017eete zkop\u00edrovat v\u00fd\u0148atky na <a href=http://i2pforum.i2p/ target=_blank rel=noreferrer>f\u00f3rum</a> o pomoc, nebo je p\u0159\u00edmo <a href=http://cake.i2p/pastebin/ target=_blank rel=noreferrer class='sitelink external'>vlo\u017eit</a> a v odkazu na IRC odkazovat na pomoc.";
    t[8574] = "Plugins signed with the cryptographic key of the developer are the recommended format, but if you wish to install unsigned plugins (.zip) you can set this to true. Note that you may still encounter issues attempting to install an unsigned plugin if the developer has included additional checks in the plugin build process.";
    t[8575] = "Doporu\u010den\u00fdm form\u00e1tem jsou z\u00e1suvn\u00e9 moduly podepsan\u00e9 kryptografick\u00fdm kl\u00ed\u010dem v\u00fdvoj\u00e1\u0159e, ale pokud si p\u0159ejete instalovat nesignovan\u00e9 z\u00e1suvn\u00e9 moduly (.zip), m\u016f\u017eete to nastavit na true. V\u0161imn\u011bte si, \u017ee v p\u0159\u00edpad\u011b pokusu o instalaci nesignovan\u00e9ho z\u00e1suvn\u00e9ho modulu m\u016f\u017eete st\u00e1le narazit na probl\u00e9my, pokud v\u00fdvoj\u00e1\u0159 zahrnul do procesu sestavov\u00e1n\u00ed z\u00e1suvn\u00e9ho modulu dal\u0161\u00ed kontroly.";
    t[8578] = "If you are running a standalone Tor instance locally, you may use it by configuring I2P to use: <i>Proxy type:</i> <code>SOCKS 5</code> <i>Host:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9050</code>.";
    t[8579] = "Pokud b\u011b\u017e\u00ed samostatn\u00e1 instance Tor lok\u00e1ln\u011b, m\u016f\u017eete ji pou\u017e\u00edt konfigurac\u00ed I2P na: <i>Typ proxy:</i> <code>SOCKS 5</code> <i>Hostitel:</i> <code>127.0.0.1</code> <i>Port:</i> <code>9050</code>.";
    t[8584] = "Select the language to be used for the router console and web applications (<a href=/webmail target=_blank rel=noreferrer>webmail</a>, <a href=/torrents target=_blank rel=noreferrer>torrents</a>, <a href=/i2ptunnelmgr target=_blank rel=noreferrer>tunnel manager</a> etc). If you wish to change the language in future, change the router console theme, or configure a password to access the console, you may do so on the <a href=/configui target=_blank rel=noreferrer>User Interface configuration page</a>.";
    t[8585] = "Vyberte jazyk, kter\u00fd se m\u00e1 pou\u017e\u00edt pro ovl\u00e1dac\u00ed pult a webov\u00e9 aplikace sm\u011brova\u010de (<a href=/webmail target=_blank rel=noreferrer>webmail</a>, <a href=/torrents target=_blank rel=noreferrer>torrents</a>, <a href=/i2ptunnelmgr target=_blank rel=noreferrer>spr\u00e1vce tunel\u016f</a> atd.). Pokud si p\u0159ejete v budoucnu zm\u011bnit jazyk, zm\u011bnit motiv ovl\u00e1dac\u00edho pultu nebo nastavit heslo pro p\u0159\u00edstup k ovl\u00e1dac\u00edmu panelu, m\u016f\u017eete to ud\u011blat na str\u00e1nce <a href=/configui target=_blank rel=noreferrer>nastaven\u00ed u\u017eivatelsk\u00e9ho rozhran\u00ed</a>.";
