    t[9292] = "This setting (in minutes) allows you to manually configure how long to wait after startup before RouterInfos in the NetDb are checked for validity, after which point only valid routers will be accepted for inclusion. When the validation occurs, expired RouterInfos and unresponsive peers only accessible via SSU will be removed from the NetDb. [Default is 60 minutes] Note: This setting has no bearing on older routers (older than 0.9.29 by default) which are removed from the NetDb and banned for the router session as soon as a NetDb store is attempted.";
    t[9293] = "Toto nastaven\u00ed (v minut\u00e1ch) v\u00e1m umo\u017e\u0148uje manu\u00e1ln\u011b nastavit, jak dlouho po spu\u0161t\u011bn\u00ed po\u010dk\u00e1te, ne\u017e se kontroluj\u00ed RouterInfos v NetDb z hlediska platnosti, po kter\u00e9m budou do p\u0159\u00edjmu p\u0159ijaty pouze platn\u00e9 routery. P\u0159i validaci jsou z NetDb odebr\u00e1ny neplatn\u00e9 RouterInfos a nep\u0159\u00edstupn\u00e9 servery, kter\u00e9 jsou p\u0159\u00edstupn\u00e9 pouze prost\u0159ednictv\u00edm SSU. [V\u00fdchoz\u00ed hodnota je 60 minut] Pozn\u00e1mka: Toto nastaven\u00ed nem\u00e1 vliv na star\u0161\u00ed routery (star\u0161\u00ed ne\u017e ve v\u00fdchoz\u00edm nastaven\u00ed 0.9.29), kter\u00e9 jsou z NetDb odebr\u00e1ny a banov\u00e1ny pro aktu\u00e1ln\u00ed sezen\u00ed routov\u00e1n\u00ed hned, jakmile je pokus o ulo\u017een\u00ed do NetDb.";
