    t[9354] = "Reseeding is the bootstrapping process used to find other routers when you first install I2P, or when your router has too few router references remaining. The default settings will work for most people. Change these only if HTTPS is blocked by a restrictive firewall and reseed has failed.";
    t[9355] = "P\u0159es\u00eddlen\u00ed je proces bootstrappingu pou\u017eit\u00fd pro nalezen\u00ed dal\u0161\u00edch router\u016f p\u0159i prvn\u00ed instalaci I2P nebo pokud v\u00e1\u0161 router m\u00e1 p\u0159\u00edli\u0161 m\u00e1lo odkaz\u016f na routery. V\u00fdchoz\u00ed nastaven\u00ed funguje pro v\u011bt\u0161inu lid\u00ed. Upravujte pouze pokud je HTTPS blokov\u00e1no restriktivn\u00edm firewallem a p\u0159es\u00eddlen\u00ed selhalo.";
    t[9362] = "This setting, when enabled, modifies the maximum additional random pong delay introduced for ping-enabled servers, if <code>i2p.streaming.enablePongDelay</code> is also enabled. Unless explicitly set, the default value of 50ms will be used.";
    t[9363] = "Toto nastaven\u00ed, pokud je povoleno, upravuje maxim\u00e1ln\u00ed dal\u0161\u00ed n\u00e1hodn\u00fd zpo\u017ed\u011bn\u00fd pong zaveden\u00fd pro servery povolen\u00e9 pro odpov\u00edd\u00e1n\u00ed na pingy, pokud je tak\u00e9 povoleno <code>i2p.streaming.enablePongDelay</code>. Pokud nen\u00ed explicitn\u011b nastaveno, bude pou\u017eita v\u00fdchoz\u00ed hodnota 50 ms.";
