    t[9474] = "Your I2P+ router by default contributes to the network by routing internal, end-to-end encrypted traffic for other routers, known as <i>participation</i>. Bandwidth participation improves the anonymity level of all users on the network and maximizes your download speed.";
    t[9475] = "V\u00e1\u0161 sm\u011brova\u010d I2P+ p\u0159isp\u00edv\u00e1 v\u00fdchoz\u00edm nastaven\u00edm k s\u00edti sm\u011brov\u00e1n\u00edm vnit\u0159n\u00edho, koncov\u011b-ke-koncov\u011b \u0161ifrovan\u00e9ho provozu pro ostatn\u00ed sm\u011brova\u010de, zn\u00e1m\u00fd tak\u00e9 jako <i>\u00fa\u010dast</i>. \u00da\u010dast na \u0161\u00ed\u0159ce p\u00e1sma zlep\u0161uje anonymitu v\u0161ech u\u017eivatel\u016f v s\u00edti a maximalizuje va\u0161i rychlost stahov\u00e1n\u00ed.";
    t[9476] = "This setting permits the configuration of alternative NTP servers required to ensure that your router maintains accurate clock time. [Default is 0.pool.ntp.org,1.pool.ntp.org,2.pool.ntp.org]";
    t[9477] = "Toto nastaven\u00ed umo\u017e\u0148uje konfiguraci alternativn\u00edch NTP server\u016f, kter\u00e9 jsou pot\u0159ebn\u00e9 pro zaji\u0161t\u011bn\u00ed p\u0159esn\u00e9ho \u010dasu ve va\u0161em sm\u011brova\u010di. [V\u00fdchoz\u00ed hodnota je 0.pool.ntp.org,1.pool.ntp.org,2.pool.ntp.org]";
    t[9484] = "Optimize your images";
    t[9485] = "Optimalizace obr\u00e1zk\u016f";
    t[9488] = "Note that the profiler relies on sustained client tunnel usage to accurately profile peers.";
    t[9489] = "V\u0161imn\u011bte si, \u017ee profiler se spol\u00e9h\u00e1 na trval\u00e9 pou\u017e\u00edv\u00e1n\u00ed klientsk\u00e9ho tunelu, aby p\u0159esn\u011b profiloval partnery.";
    t[9492] = "If you are in a hurry and can't wait a few hours, you can tell people to use a \"jump\" address helper redirection service. This will usually work within a few minutes of your registering your hostname on the same site. Test it yourself first by entering <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>yourchosenhostname.i2p</i></code> into your browser. Once it is working, you can tell others to use it.";
    t[9493] = "Pokud m\u00e1te n\u00e1hodou n\u00e1hle a nem\u016f\u017eete po\u010dkat p\u00e1r hodin, m\u016f\u017eete lidem \u0159\u00edct, aby pou\u017eili slu\u017ebu p\u0159esm\u011brov\u00e1n\u00ed pomocn\u00fdch adres \"jump\". Obvykle to funguje do n\u011bkolika minut pot\u00e9, co zaregistrujete sv\u016fj hostname na stejn\u00e9m webu. Nejd\u0159\u00edve to otestujte sami t\u00edm, \u017ee zad\u00e1te <code>http://stats.i2p/cgi-bin/jump.cgi?a=<i>v\u00e1\u0161volen\u00fdhostname.i2p</i></code> do sv\u00e9ho prohl\u00ed\u017ee\u010de. Jakmile to funguje, m\u016f\u017eete \u0159\u00edct ostatn\u00edm, aby to tak\u00e9 pou\u017e\u00edvali.";
