    t[9580] = "Note that the full path to the output files must be accessible before deploying the filter. If the target directory does not exist, the destinations will not be recorded and an error will appear in the router logs. The files will be created as required. The examples provided above are not recommendations; your configuration should be tuned according to the amount of content (number and size of files) your site is serving, the speed of the server, and the frequency with which the site is updated. Configuring recorders and monitoring the resulting files will help you fine tune the settings.";
    t[9581] = "V\u0161imn\u011bte si, \u017ee pln\u00e1 cesta k v\u00fdstupn\u00edm soubor\u016fm mus\u00ed b\u00fdt p\u0159\u00edstupn\u00e1 p\u0159ed nasazen\u00edm filtru. Pokud c\u00edlov\u00fd adres\u00e1\u0159 neexistuje, destinace nebudou zaznamen\u00e1v\u00e1ny a v protokolech sm\u011brova\u010de se zobraz\u00ed chyba. Soubory budou vytvo\u0159eny podle pot\u0159eby. Uveden\u00e9 p\u0159\u00edklady nejsou doporu\u010den\u00ed; nastaven\u00ed by m\u011blo b\u00fdt p\u0159izp\u016fsobeno mno\u017estv\u00ed obsahu (po\u010dtu a velikosti soubor\u016f), kter\u00fd v\u00e1\u0161 web poskytuje, rychlosti serveru a frekvenci aktualizace webu. Nastaven\u00ed z\u00e1znamn\u00edk\u016f a monitorov\u00e1n\u00ed v\u00fdsledn\u00fdch soubor\u016f v\u00e1m pomohou doladit nastaven\u00ed.";
