    t[9630] = "Tunnels built by other routers through your router. This may vary widely depending on network demand, your shared bandwidth, and amount of locally-generated traffic. The recommended method for limiting participating tunnels is to change your share percentage on the <a  href='/config'>Bandwidth Configuration page</a>. You may also limit the total number by setting <code>router.maxParticipatingTunnels=nnn</code> on the <a href='/configadvanced'>Advanced configuration page</a>. <a href='/configstats#tunnel.participatingTunnels'>[Enable graphing]</a>.";
    t[9631] = "Tunely vybudovan\u00e9 jin\u00fdmi routery skrz v\u00e1\u0161 router. To se m\u016f\u017ee velmi li\u0161it v z\u00e1vislosti na s\u00ed\u0165ov\u00e9m vyt\u00ed\u017een\u00ed, sd\u00edlen\u00e9 \u0161\u00ed\u0159ce p\u00e1sma a mno\u017estv\u00ed lok\u00e1ln\u011b generovan\u00e9ho provozu. Doporu\u010denou metodou pro omezen\u00ed \u00fa\u010dastn\u00edc\u00edch se tunel\u016f je zm\u011bnit procento sd\u00edlen\u00ed na <a  href='/config'>konfigura\u010dn\u00ed str\u00e1nce \u0161\u00ed\u0159ky p\u00e1sma</a>. Tak\u00e9 m\u016f\u017eete omezit celkov\u00fd po\u010det nastaven\u00edm <code>router.maxParticipatingTunnels=nnn</code> na <a href='/configadvanced'>str\u00e1nce pokro\u010dil\u00e9 konfigurace</a>. <a href='/configstats#tunnel.participatingTunnels'>[Povolit grafy]</a>.";
