    t[10038] = "To configure an alternative webserver for use on I2P, you can either use the existing webserver tunnel and <a href=/configclients>disable the default webserver</a> from running, or create a new HTTP Server tunnel in the <a href=/i2ptunnelmgr>Tunnel Manager</a>. Ensure that the webserver's <i>listening port</i> is also configured in the Tunnel Manager settings. For example, if your webserver is listening by default on address 127.0.0.1 port 80, you'd also need to ensure that the <i>Target port</i> in the Tunnel Manager settings page for the service is also configured to port 80.";
    t[10039] = "Chcete-li nakonfigurovat alternativn\u00ed webov\u00fd server pro pou\u017eit\u00ed v I2P, m\u016f\u017eete pou\u017e\u00edt st\u00e1vaj\u00edc\u00ed tunel webov\u00e9ho serveru a <a href=/configclients>deaktivujte v\u00fdchoz\u00ed webov\u00fd server</a>, nebo v&nbsp;<a href=/i2ptunnelmgr>, nakonfigurujte nov\u00fd tunel HTTP serveru v Manageru tunel\u016f</a>. Ujist\u011bte se, \u017ee<b>poslouch\u00e1n\u00ed portu</b> webov\u00e9ho serveru je tak\u00e9 nakonfigurov\u00e1no v nastaven\u00ed Manageru tunel\u016f. Nap\u0159\u00edklad, pokud v\u00e1\u0161 webov\u00fd server implicitn\u011b poslouch\u00e1 na adrese 127.0.0.1 portu 80, mus\u00edte tak\u00e9 zajistit, aby<b>Port c\u00edle</b> na str\u00e1nce nastaven\u00ed Manageru tunel\u016f pro slu\u017ebu byl nakonfigurov\u00e1n na portu 80.";
