    t[10046] = "An I2P router usually only needs to be seeded once, to join the network for the first time. However, if the router is running for an extended period without network connectivity it may also need to be reseeded. Reseeding involves fetching multiple \"RouterInfo\" files (bundled into a signed zip-file) from at least two predefined server URLs picked from a volunteer-run group of clearnet HTTPS servers.";
    t[10047] = "Sm\u011brova\u010d I2P obvykle pot\u0159ebuje b\u00fdt zako\u0159en\u011bn pouze jednou, aby se p\u0159ipojil k s\u00edti poprv\u00e9. Pokud v\u0161ak sm\u011brova\u010d b\u011b\u017e\u00ed po del\u0161\u00ed dobu bez p\u0159ipojen\u00ed k s\u00edti, m\u016f\u017ee tak\u00e9 pot\u0159ebovat zasejat. Zasej\u00e1n\u00ed zahrnuje z\u00edsk\u00e1v\u00e1n\u00ed n\u011bkolika soubor\u016f \u201eRouterInfo\u201c (sbalen\u00fdch do podepsan\u00e9ho zip souboru) z alespo\u0148 dvou p\u0159eddefinovan\u00fdch serverov\u00fdch adres URL vybran\u00fdch z dobrovolnick\u00e9 skupiny server\u016f s clearnetovou podporou HTTPS.";
