    t[10076] = "A list of countries derived from the <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>World Freedom Report</a> with a poor civil liberties reputation. This list is used to place routers running in the specified countries in <i>Hidden Mode</i> to provide enhanced security for users. The following countries are designated as strict: Afghanistan, Azerbaijan, Bahrain, Belarus, Brunei, Burundi, Cameroon, Central African Republic, Chad, China, Cuba, Democratic Republic of the Congo, Egypt, Equatorial Guinea, Eritrea, Ethiopia, Iran, Kazakhstan, Laos, Libya, Myanmar, North Korea, Palestinian Territories, Rwanda, Saudi Arabia, Somalia, South Sudan, Sudan, Eswatini (Swaziland), Syria, Tajikistan, Thailand, Turkey, Turkmenistan, Venezuela, United Arab Emirates, Uzbekistan, Western Sahara, Yemen.";
    t[10077] = "Seznam zem\u00ed odvozen\u00fd z <a href=https://freedomhouse.org/report/countries-world-freedom-2019 class='sitelink external' target=_blank rel=noreferrer>Zpr\u00e1vy o svobod\u011b ve sv\u011bte</a> obsahuj\u00edc\u00ed zem\u011b s pov\u011bst\u00ed chab\u00fdch ob\u010dansk\u00fdch svobod. Tento seznam se pou\u017e\u00edv\u00e1 k um\u00edst\u011bn\u00ed router\u016f, kter\u00e9 b\u011b\u017e\u00ed ve specifikovan\u00fdch zem\u00edch do <i>Skryt\u00e9ho re\u017eimu</i> za \u00fa\u010delem zv\u00fd\u0161en\u00ed bezpe\u010dnosti u\u017eivatel\u016f. N\u00e1sleduj\u00edc\u00ed zem\u011b jsou ozna\u010deny jako p\u0159\u00edsn\u00e9: Afgh\u00e1nist\u00e1n, \u00c1zerb\u00e1jd\u017e\u00e1n, Bahrajn, B\u011blorusko, Brunej, Burundi, Kamerun, St\u0159edoafrick\u00e1 republika, \u010cad, \u010c\u00edna, Kuba, Demokratick\u00e1 republika Kongo, Egypt, Rovn\u00edkov\u00e1 Guinea, Eritrea, Etiopie, \u00cdr\u00e1n, Kazachst\u00e1n, Laos, Libye, Myanmar, Severn\u00ed Korea, Palestinsk\u00e1 \u00fazem\u00ed, Rwanda, Sa\u00fadsk\u00e1 Ar\u00e1bie, Som\u00e1lsko, Ji\u017en\u00ed S\u00fad\u00e1n, S\u00fad\u00e1n, Svatini (Svazijsko), S\u00fdrie, T\u00e1d\u017eikist\u00e1n, Thajsko, Turecko, Turkmenist\u00e1n, Venezuela, Spojen\u00e9 arabsk\u00e9 emir\u00e1ty, Uzbekist\u00e1n, Z\u00e1padn\u00ed Sahara, Jemen.";
