    t[10318] = "Where possible, please ensure I2P+/Java is allowed bi-directional port access from the internet by configuring your modem/router/pc firewall accordingly. If you're behind a prohibitive firewall but have unrestricted outbound access, I2P+ can still function; you can turn off inbound access and rely on <a href=http://i2p-projekt.i2p/udp.html target=_blank rel=noreferrer class=sitelink>SSU IP Address Detection</a> (<a href=https://wikipedia.org/wiki/Hole_punching target=_blank rel=noreferrer class='sitelink external'>firewall hole punching</a>) to connect you to the network, and your network status in the side panel will indicate \"Status: Firewalled\". For optimal performance, please ensure I2P's <a href=/confignet#udpconfig>external port</a> is visible from the internet (see below for more information).";
    t[10319] = "Kde je to mo\u017en\u00e9, ujist\u011bte se, pros\u00edm, \u017ee je I2P+/Java umo\u017en\u011bn dvousm\u011brn\u00fd p\u0159\u00edstup k p\u0159\u00edstav\u016f od internetu t\u00edm, \u017ee nakonfigurujete va\u0161i modem/router/PC firewall podle pot\u0159eby. Pokud jste za p\u0159\u00edli\u0161n\u011b omezuj\u00edc\u00edm firewallem, ale m\u00e1te neomezen\u00fd odchoz\u00ed p\u0159\u00edstup, I2P+ m\u016f\u017ee st\u00e1le fungovat. M\u016f\u017eete vypnout p\u0159\u00edstup zvenku a spolehnout se na <a href=http://i2p-projekt.i2p/udp.html target=_blank rel=noreferrer class=sitelink>detekci SSU IP adresy</a> (<a href=https://wikipedia.org/wiki/Hole_punching target=_blank rel=noreferrer class='sitelink external'>prokop\u00e1v\u00e1n\u00ed firewallu</a>) pro p\u0159ipojen\u00ed k s\u00edti a stav s\u00edt\u011b na bo\u010dn\u00edm panelu v\u00e1m indikuje \u201eStav: Firewall\u201c. Pro optim\u00e1ln\u00ed v\u00fdkon se ujist\u011bte, pros\u00edm, \u017ee je I2P <a href=/confignet#udpconfig>extern\u00ed p\u0159\u00edstav</a> viditeln\u00fd z internetu (viz n\u00ed\u017ee v\u00edce informac\u00ed).";
