    t[10636] = "Jurist";
    t[10637] = "Jurist";
    t[10644] = "Skip Setup";
    t[10645] = "P\u0159esko\u010dit nastaven\u00ed";
    t[10650] = "Duplicate packets received from peer";
    t[10651] = "Duplicitn\u00ed pakety p\u0159ijat\u00e9 od partnera";
    t[10660] = "Services may be hosted on multiple routers simultaneously, by sharing the same private key for the destination. Multihoming can further enhance the security and stability of a server by providing redundancy; if a server is multihomed, when a server in the pool goes offline, the provided service will remain available, making it more difficult to correlate server downtime with a router going offline.";
    t[10661] = "Slu\u017eby mohou b\u00fdt hostov\u00e1ny na n\u011bkolika routerech sou\u010dasn\u011b, sd\u00edlen\u00edm stejn\u00e9ho priv\u00e1tn\u00edho kl\u00ed\u010de pro c\u00edl. Multihoming m\u016f\u017ee d\u00e1le zlep\u0161it bezpe\u010dnost a stabilitu serveru t\u00edm, \u017ee poskytuje redundanci; pokud je server multihomed, kdy\u017e jeden ze server\u016f ve skupin\u011b jde offline, poskytovan\u00e1 slu\u017eba z\u016fstane k dispozici, co\u017e \u010din\u00ed obt\u00ed\u017en\u011bj\u0161\u00edm korelaci v\u00fdpadk\u016f serveru s v\u00fdpadky routeru.";
    t[10672] = "Client Configuration";
    t[10673] = "Konfigurace klienta";
    t[10674] = "Ensure your Java is up to date. Version 1.8 or higher is required; version 11 or higher is recommended. Check your Java version at the top of <a href=/info>the router information page</a>.";
    t[10675] = "Zajist\u011bte, aby va\u0161e Java byla aktu\u00e1ln\u00ed. Vy\u017eaduje se verze 1.8 nebo vy\u0161\u0161\u00ed; verze 11 nebo vy\u0161\u0161\u00ed je doporu\u010dena. Zkontrolujte svou verzi Javy na vrcholu <a href=/info>str\u00e1nky s informacemi o p\u0159ipojen\u00ed</a>.";
