    t[10710] = "The process of acquiring router identities, normally via <i>clearnet</i> servers, to ensure your router can communicate and build tunnels with other routers on the network. When a router has no router identities for other peers (usually immediately after installation), the process of reseeding is also referred to as <i>bootstrapping</i>.";
    t[10711] = "Proces z\u00edsk\u00e1n\u00ed identit router\u016f, obvykle prost\u0159ednictv\u00edm server\u016f <i>clearnetu</i>, aby bylo zaji\u0161t\u011bno, \u017ee v\u00e1\u0161 router m\u016f\u017ee komunikovat a vytv\u00e1\u0159et tunely s ostatn\u00edmi routery v s\u00edti. Kdy\u017e router nem\u00e1 \u017e\u00e1dn\u00e9 identifik\u00e1tory routeru pro ostatn\u00ed uzly (co\u017e je obvykle okam\u017eit\u011b po instalaci), proces obnovov\u00e1n\u00ed se tak\u00e9 naz\u00fdv\u00e1 <i>restartov\u00e1n\u00ed</i>.";
