    t[10746] = "A tunnel used by the router for communicating with other routers to perform various \"housekeeping\" functions such as learning and publishing <i>leasesets</i>, testing client tunnels, and learning about and validating other routers in the network. These tunnels are normally low-bandwidth.";
    t[10747] = "Tunel pou\u017e\u00edvan\u00fd sm\u011brova\u010dem pro komunikaci s dal\u0161\u00edmi sm\u011brova\u010di a prov\u00e1d\u011bn\u00ed r\u016fzn\u00fdch \"\u00fadr\u017ebov\u00fdch\" funkc\u00ed, jako je u\u010den\u00ed a publikov\u00e1n\u00ed \u201eleaseset\u016f\u201c, testov\u00e1n\u00ed klientov\u00fdch tunel\u016f a zji\u0161\u0165ov\u00e1n\u00ed a ov\u011b\u0159ov\u00e1n\u00ed dal\u0161\u00edch sm\u011brova\u010d\u016f v s\u00edti. Tyto tunely jsou obvykle n\u00edzkokapacitn\u00ed.";
