    t[10767] = "Alternativn\u00ed implementace routeru I2P naprogramovan\u00e1 v jazyce C++. Dal\u0161\u00ed informace naleznete na <a href=https://i2pd.website/ class='sitelink external' target=_blank rel=noreferrer>https://i2pd.website/</a>. Zdrojov\u00fd k\u00f3d je k dispozici na <a href=https://github.com/PurpleI2P/i2pd class='sitelink external' target=_blank rel=noreferrer>GitHubu</a>.";
