    t[11024] = "By default, I2P will use the system configured default browser to launch at startup. If you wish to nominate an alternative browser, you will need to edit your router.config file (or the <a href=/configadvanced>Advanced Configuration page</a> if you have enabled advanced console mode) and add a new configuration line <code>routerconsole.browser=/path/to/browser</code> or <code>routerconsole.browser=\\path\\to\\browser.exe</code> if using Windows, replacing <code>\\path\\to\\browser</code> with the location of the browser you wish to use. Note: If the path to your chosen browser contains spaces, you may need to encase the path in quotes e.g. <code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code>";
    t[11025] = "V\u00fdchoz\u00ed nastaven\u00ed I2P pou\u017e\u00edv\u00e1 pro spu\u0161t\u011bn\u00ed p\u0159i startu syst\u00e9mu p\u0159eddefinovan\u00fd prohl\u00ed\u017ee\u010d. Pokud chcete ur\u010dit jin\u00fd prohl\u00ed\u017ee\u010d, budete muset upravit soubor router.config (nebo str\u00e1nku <a href=/configadvanced>Advanced Configuration</a>, pokud jste povolili roz\u0161\u00ed\u0159en\u00fd re\u017eim konzole) a p\u0159idat novou konfigura\u010dn\u00ed \u0159\u00e1dku <code>routerconsole.browser=/cesta/k/prohl\u00ed\u017ee\u010di</code> nebo <code>routerconsole.browser=\\cesta\\k\\prohliza\u010di.exe</code> pokud pou\u017e\u00edv\u00e1te Windows, p\u0159i\u010dem\u017e <code>\\cesta\\k\\prohl\u00ed\u017ee\u010di</code> nahra\u010fte um\u00edst\u011bn\u00edm prohl\u00ed\u017ee\u010de, kter\u00fd chcete pou\u017e\u00edt. Pozn\u00e1mka: Pokud cesta k vybran\u00e9mu prohl\u00ed\u017ee\u010di obsahuje mezery, m\u016f\u017ee b\u00fdt nutn\u00e9 cestu obalit uvozovkami, nap\u0159. <code>routerconsole.browser=\"C:\\Program Files\\Mozilla\\Firefox.exe\"</code>";
