    t[11658] = "Your modem or router may support <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Universal Plug &amp; Play</a> (UPnP), which permits automatic port forwarding. Ensure UPnP support for I2P+ is enabled on the <a href=/confignet>config page</a>, then try to activate UPnP on your modem/router and possibly your computer also. Now try restarting the <a href=/>I2P+ router</a>. If successful, I2P+ should report \"Status: OK\" in the side panel once the I2P+ router completes initial connectivity tests.";
    t[11659] = "V\u00e1\u0161 modem nebo router m\u016f\u017ee podporovat <a href=https://wikipedia.org/wiki/Universal_Plug_and_Play target=_blank rel=noreferrer>Univerz\u00e1ln\u00ed z\u00e1suvnou a hru</a> (UPnP), kter\u00e1 umo\u017e\u0148uje automatick\u00e9 p\u0159esm\u011brov\u00e1n\u00ed port\u016f. Ujist\u011bte se, \u017ee je povolena podpora UPnP pro I2P+ na <a href=/confignet>konfigura\u010dn\u00ed str\u00e1nce</a>, pot\u00e9 se pokuste aktivovat UPnP na sv\u00e9m modem/routeru a p\u0159\u00edpadn\u011b tak\u00e9 na sv\u00e9m po\u010d\u00edta\u010di. Zkuste nyn\u00ed restartovat <a href=/>sm\u011brova\u010d I2P+</a>. Pokud se poda\u0159\u00ed, I2P+ by v bo\u010dn\u00edm panelu m\u011bl zobrazit \"Stav: OK\", jakmile sm\u011brova\u010d I2P+ dokon\u010d\u00ed po\u010d\u00e1te\u010dn\u00ed testy konektivity.";
