    t[11982] = "If your TCP port is firewalled with inbound TCP enabled, routers will not be able to contact you via TCP, which will hurt the network.";
    t[11983] = "Pokud je v\u00e1\u0161 TCP port ve firewallu s povolen\u00fdm p\u0159\u00edchoz\u00edm TCP, sm\u011brova\u010de nebudou moci s v\u00e1mi komunikovat p\u0159es TCP, co\u017e po\u0161kod\u00ed s\u00ed\u0165.";
    t[11984] = "Local Identity";
    t[11985] = "M\u00edstn\u00ed identita";
    t[11994] = "While I2P will work fine behind most firewalls, your speeds and network integration will generally improve if the I2P port is forwarded for both UDP and TCP.";
    t[11995] = "I2P bude fungovat dob\u0159e za v\u011bt\u0161inou firewall\u016f, ale va\u0161e rychlost a s\u00ed\u0165ov\u00e1 integrace se obecn\u011b zlep\u0161\u00ed, pokud bude I2P port p\u0159esm\u011brov\u00e1n pro UDP i TCP.";
