    t[12026] = "I2P FAQ";
    t[12027] = "I2P FAQ";
    t[12028] = "If you hover over the <i>Router Info</i> heading, your truncated router identity will be shown (the first four characters (24 bits) of your 44-character (256-bit) Base64 router hash). The full hash is shown on your <a href='netdb?r=.'>Network Database entry</a>. Never reveal this to anyone, as your router identity is uniquely linked to your IP address in the network database.";
    t[12029] = "Pokud najedete my\u0161\u00ed na nadpis <i>Informace o routeru</i>, zobraz\u00ed se zkr\u00e1cen\u00e1 identita va\u0161eho routeru (prvn\u00ed \u010dty\u0159i znaky (24 bit\u016f) z va\u0161eho 44m\u00edstn\u00e9ho (256 bit\u016f) Base64 k\u00f3dovan\u00e9ho otisku routeru). Pln\u00fd otisk je zobrazen ve va\u0161em <a href='netdb?r=.'>z\u00e1znamu v s\u00ed\u0165ov\u00e9 datab\u00e1zi</a>. Nikomu to nikdy nezve\u0159ej\u0148ujte, proto\u017ee va\u0161e routerov\u00e1 identita je jedine\u010dn\u011b propojena s va\u0161\u00ed IP adresou v s\u00ed\u0165ov\u00e9 datab\u00e1zi.";
    t[12030] = "Previous";
