    t[12200] = "If the number of known peers drops below 50, I2P will attempt to reseed automatically. If the reseed attempt fails, a notification will appear in the sidebar with an option to manually reseed. A failed reseed attempt can occur if your local firewall limits outbound traffic, you are experiencing network connectivity issues, or if the reseed request is blocked entirely.";
    t[12201] = "Pokud se po\u010det zn\u00e1m\u00fdch peer\u016f sn\u00ed\u017e\u00ed pod 50, I2P se pokus\u00ed automaticky prov\u00e9st zasejen\u00ed. Pokud pokus o zasejen\u00ed sel\u017ee, na bo\u010dn\u00ed li\u0161t\u011b se zobraz\u00ed upozorn\u011bn\u00ed s mo\u017enost\u00ed ru\u010dn\u00edho zasejen\u00ed. Pokus o zasejen\u00ed sel\u017ee, m\u016f\u017ee se st\u00e1t, pokud va\u0161e m\u00edstn\u00ed firewall omezuje odchoz\u00ed provoz, m\u00e1te probl\u00e9my s p\u0159ipojen\u00edm k s\u00edti nebo pokud je po\u017eadavek na zasejen\u00ed zablokov\u00e1n \u00fapln\u011b.";
    t[12202] = "Alternative privacy-focused front-end for Reddit";
    t[12203] = "Alternativn\u00ed front-end zam\u011b\u0159en\u00fd na soukrom\u00ed pro Reddit";
    t[12224] = "Toggle Tunnels";
    t[12225] = "P\u0159epnout tunely";
    t[12228] = "Can be disabled in the <code>clients.config</code> file. Can also be configured to bind to a specific interface or all interfaces in the <code>jetty.xml</code> file.";
    t[12229] = "M\u016f\u017ee b\u00fdt zak\u00e1z\u00e1no v souboru <code>clients.config</code>. M\u016f\u017ee b\u00fdt tak\u00e9 konfigurov\u00e1no k p\u0159ipojen\u00ed k ur\u010dit\u00e9mu rozhran\u00ed nebo ke v\u0161em rozhran\u00edm v souboru <code>jetty.xml</code>.";
    t[12230] = "You can determine which services automatically start when the router starts, manage tunnel allocation to optimize for high usage services or to minimize the the cpu and memory overhead, add server and client tunnels to host or access services on the network, set rate limiting or tunnel filtering for your server tunnels and more.";
    t[12231] = "M\u016f\u017eete ur\u010dit, kter\u00e9 slu\u017eby se automaticky spust\u00ed p\u0159i startu routeru, spravovat p\u0159id\u011blov\u00e1n\u00ed tunel\u016f pro optimalizaci vysoko vyt\u00ed\u017een\u00fdch slu\u017eeb nebo ke sn\u00ed\u017een\u00ed vyt\u00ed\u017een\u00ed CPU a pam\u011bti, p\u0159id\u00e1vat serverov\u00e9 a klientov\u00e9 tunely pro hostov\u00e1n\u00ed nebo p\u0159\u00edstup k slu\u017eb\u00e1m v s\u00edti, nastavovat omezen\u00ed p\u0159enosov\u00e9 rychlosti nebo filtrov\u00e1n\u00ed tunel\u016f pro sv\u00e9 serverov\u00e9 tunely a mnoho dal\u0161\u00edho.";
    t[12232] = "Binds to the LAN address. Can be changed with advanced config <code>i2np.upnp.HTTPPort=nnnn</code>. Can be disabled on the <a href=/confignet>Network Configuration page</a>.";
    t[12233] = "V\u00e1\u017ee se na LAN adresu. Lze ji zm\u011bnit pomoc\u00ed pokro\u010dil\u00e9 konfigurace <code>i2np.upnp.HTTPPort=nnnn</code>. Lze ji zak\u00e1zat na <a href=/confignet> str\u00e1nce konfigurace s\u00edt\u011b </a>.";
